            array('Ambria','1','Germany','Use of the English gemstone name amber (amber) as a first name','Verwendung der englischen Edelstein-Bezeichnung amber (Bernstein) als Vorname','Përdorimi i emrit anglez të gurëve të çmuar qelibar (qelibar) si emër të parë'),
