            array('Ameleya','1','Germany','Probably a literary variation of Amelie. From a poem by Clemens Brentano','Wahrscheinlich literarische Abwandlung von Amelie. Aus einem Gedicht von Clemens Brentano\\n  ','Ndoshta një variant letrar i Amelie. Nga një poezi e Clemens Brentano'),
            array('Ameliana','1','Germany','Variant of Amelia','Variante von Amelia','Varianti i Amelisë'),
            array('Amelie','1','Germany','The first name Amelie is the German version of the French female first name Am\u00e9lie, which in turn is the romanized form of the originally Gothic name Amalie. The name goes back to the Amalians, an Ostrogothic ruling family from the 4th century. Amalie has been used since the 15th century In Germany it was given as a dynastic, noble and common name. Over time it became a short form of names that begin with the element Amal-, such as Amalberga, Amlagund or Amalfrieda. The word component amal roughly means efficient or brave. The name Amelie can therefore be interpreted as being from the Amaler family as well as the capable or brave one. Amelie had its first heyday in the 18th century. After that, its popularity continued to decline. Only since the middle In the 1980s, Amelie was again increasingly given to newborn girls and is now regularly ranked among the 30 most frequently given names of a year. The first name gained particular fame through the film The Fabulous World of Am\u00e9lie from 2001. The year after the film was released, the name suddenly jumped to number 25 of the most popular girls first names in Germany. Amelie is also a well-known term from pathology. A less popular detail might be the meaning of the word Amelie from patrology. There Amelie describes the lack of limbs in newborns. This is certainly a reason for superstitious parents not to decide on this name until they are in advanced pregnancy. ','Der Vorname Amelie ist die deutsche Version des französischen weiblichen Vornamens Am\u00e9lie, der seinerseits die romanisierte Form des ursprünglich gotischen Namens Amalie ist. Der Name geht zurück auf die Amaler, ein ostgotisches Herrschergeschlecht aus dem 4. Jahrhundert. Seit dem 15. Jahrhundert wird Amalie in Deutschland als dynastischer, als adliger und als bürgerlicher Name vergeben. Im Laufe der Zeit verselbständigte er sich zu einer Kurzform von Namen, die mit dem Element Amal- beginnen, wie zum Beispiel Amalberga, Amlagund oder Amalfrieda. Der Wortbestandteil amal bedeutet in etwa tüchtig bzw. tapfer. Der Name Amelie kann also sowohl mit aus dem Geschlecht der Amaler als auch mit die Tüchtige bzw. die Tapfere interpretiert werden.\\n Eine erste Hochphase hatte Amelie bereits im 18. Jahrhundert. Danach nahm die Popularität immer weiter ab. Erst seit Mitte der 1980er Jahre wird Amelie wieder vermehrt an neugeborene Mädchen vergeben. Mittlerweile kann er sich regelmäßig unter den 30 am häufigsten vergebenen Namen eines Jahres platzieren.\\n Besondere Bekanntheit erlangte der Vorname vor allem durch den Film Die fabelhafte Welt der Am\u00e9lie aus dem Jahr 2001. Im Jahr nach Erscheinen des Film sprang der Name plötzlich auf Platz 25 der beliebtesten Mädchen-Vornamen in Deutschland.\\n Amelie ist zudem auch ein bekannter Begriff aus der Pathologie. Eine weniger beliebtes Detail dürfte die Bedeutung des Wortes Amelie aus der Patrologie sein. Dort bezeichnet Amelie das Fehlen von Gliedmaßen bei Neugeborenen. Für abergläubische Eltern sicher ein Grund, sich erst in vorangeschrittener Schwangerschaft für diesen Namen zu entscheiden.','Emri i parë Amelie është versioni gjerman i emrit të parë femëror francez Am\u00e9lie, i cili nga ana tjetër është forma e romanizuar e emrit fillimisht gotik Amalie. Emri shkon prapa në amalianët, një familje sunduese ostrogotike nga shekulli i 4-të. Amalie ka përdoret që në shekullin e 15-të Në Gjermani u dha si emër dinastik, fisnik dhe i zakonshëm.Me kalimin e kohës u bë një formë e shkurtër emrash që fillojnë me elementin Amal-, si Amalberga, Amlagund ose Amalfrieda.Fjala përbërëse amal afërsisht do të thotë efikase ose e guximshme. Prandaj emri Amelie mund të interpretohet si nga familja Amaler, si dhe si e aftë ose e guximshme. Amelie pati kulmin e saj të parë në shekullin e 18. Pas kësaj, popullariteti i saj vazhdoi të binte. Vetëm që nga mesi Në vitet 1980, Amelie u jepej përsëri gjithnjë e më shumë vajzave të porsalindura dhe tani renditet rregullisht në mesin e 30 emrave më të shpeshtë të një viti. Emri i parë fitoi famë të veçantë përmes filmit Bota e mrekullueshme e Am\u00e9lie nga viti 2001. Një vit pas publikimit të filmit, emri papritur u hodh në numrin 25 të emrave më të njohur të vajzave në Gjermani. Amelie është gjithashtu një term i njohur nga patologjia. Një detaj më pak i njohur mund të jetë kuptimi i fjalës Amelie nga patrologjia. Aty Amelie përshkruan mungesën e gjymtyrëve tek të porsalindurit. Kjo sigurisht është një arsye që prindërit supersticioz të mos vendosin për këtë emër derisa të jenë në shtatzëni të avancuar. '),
