            array('Anka','1','Germany','In the Bible, Anna is the mother of Mary. Anna is originally the Greek Latin form of Hannah','In der Bibel ist Anna die Mutter Marias Anna ist ursprünglich die griechische lateinische Form von Hannah','Në Bibël, Anna është nëna e Marisë. Anna është fillimisht forma greke latine e Hanës.'),
            array('Ann Kathrin','1','Germany','Ann: In the Bible, Anna is the mother of Mary. Anna is originally the Greek Latin form of Hannah. Kathrin: Variant of Katharina; origin is disputed, the Romans (incorrectly) interpreted the name as belonging to the Greek katharos and coined the one that is valid today Form Catherine; spread by the name of St. Catherine of Alexandria (3rd 4th century). ','Ann: In der Bibel ist Anna die Mutter Marias. Anna ist ursprünglich die griechische lateinische Form von Hannah. Kathrin: Variante von Katharina; Herkunft umstritten, die Römer deuteten (fälschlicherweise) den Namen als zu griechisch katharos gehörig und prägten die heute gültige Form Katharina; verbreitet durch den Namen der hl. Katharina von Alexandria (3. 4. Jh.).','Ann: Në Bibël, Anna është nëna e Marisë. Anna është fillimisht forma greke latine e Hannah. Kathrin: Variant i Katharina; origjina është e diskutueshme, romakët (gabimisht) e interpretuan emrin se i përkiste katharos greke dhe shpiku atë që vlen sot Forma Katerina; e përhapur me emrin e Shën Katerinës së Aleksandrisë (shek. III IV).'),
            array('Ann Marie','1','Germany','Ann: in the Bible, Anna is the mother of Mary; Anna is originally the Greek Latin form of Hannah Marie: as the name of the mother of Jesus, symbol of pure and deep love, meaning not clarified with certainty; one possibility: bitterness, another possibility is an Egyptian one Origin and a derivation of mry (the beloved, in the sense of: the one who is loved the one who is loved) Mary is the Greek Latin original form, Miriam the older Aramaic Hebrew is probably the most widespread Christian female name ','Ann: in der Bibel ist Anna die Mutter Marias; Anna ist ursprünglich die griechische lateinische Form von HannahMarie: als Name der Mutter Jesu Symbol für reine und tiefe Liebe Bedeutung nicht sicher geklärt; eine Möglichkeit: Verbitterung eine andere Möglichkeit ist ein ägyptischer Ursprung und eine Ableitung von mry (die der Geliebte, im Sinne von: die, welche geliebt wird der, welcher geliebt wird) Maria ist die griechische lateinische Ursprungs-Form, Mirjam die ältere aramäische hebräische wohl der am weitesten verbreitete christliche weibliche Name ','Ann: në Bibël, Anna është nëna e Marisë; Anna është fillimisht forma greke latine e Hannah Marie: si emri i nënës së Jezusit, simbol i dashurisë së pastër dhe të thellë, që do të thotë e paqartë me siguri; një mundësi : hidhërimi, një mundësi tjetër është një egjiptiane Origjina dhe prejardhja e mry (e dashura, në kuptimin: ajo që është e dashur   ajo që është e dashur) Maria është forma origjinale greke   latine, Miriam e vjetër aramaike   Hebraishtja është ndoshta emri femëror më i përhapur i krishterë '),
            array('Ann Sophie','1','Germany','Ann: In the Bible, Anna is the mother of Mary. Anna is originally the Greek Latin form of Hannah Sophie: Known by St. Sophia, a (perhaps only mythical) Roman martyr from the 3rd century','Ann: In der Bibel ist Anna die Mutter Marias. Anna ist ursprünglich die griechische lateinische Form von Hannah Sophie: Bekannt durch die hl. Sophia, einer (vielleicht nur mythischen) römischen Märtyrerin aus dem 3. Jh.','Ann: Në Bibël, Anna është nëna e Marisë. Anna është fillimisht forma greke latine e Hannah Sophie: E njohur nga Shën Sofia, një martire (ndoshta vetëm mitike) romake nga shekulli i 3-të.'),
            array('Ann-Kathrin','1','Germany','Double name from Ann and Kathrin','Doppelname aus Ann und Kathrin','Emri i dyfishtë nga Ann dhe Kathrin'),
            array('Ann-Katrin','1','Germany','Ann: In the Bible, Anna is the mother of Mary; Anna is originally the Greek Latin form of Hannah Kathrin: origin is disputed; the Romans (incorrectly) interpreted the name as belonging to the Greek katharos and coined the form that is valid today, Katharina spread through the name of St. Catherine of Alexandria (3rd 4th century) ','Ann: In der Bibel ist Anna die Mutter Marias; Anna ist ursprünglich die griechische lateinische Form von Hannah Kathrin: Herkunft umstritten; die Römer deuteten (fälschlicherweise) den Namen als zu griechisch katharos gehörig und prägten die heute gültige Form , Katharina verbreitet durch den Namen der hl. Katharina von Alexandria (3. 4. Jh.) ','Ann: Në Bibël, Anna është nëna e Marisë; Anna është fillimisht forma greke latine e Hannah Kathrin: origjina është e diskutueshme; Romakët (gabimisht) e interpretuan emrin si i përket katharos greke dhe shpikën formën që është e vlefshme sot, Katarina u përhap përmes emrit të Shën Katerinës së Aleksandrisë (shek. III IV) '),
            array('Ann-Sophie','1','Germany','Double name from Anna or Anne and Sophie','Doppelname aus Anna bzw. Anne und Sophie','Emri i dyfishtë nga Anna ose Anne dhe Sophie'),
            array('Anna Estelle','1','Germany','Anna: The first name Anna is derived from the biblical name Hannah and means the gifted or the graceful one. According to Christian tradition, Anna is the mother of Mary, the grandmother of Jesus Christ and the wife of Joachim. Estelle: often used to be the desired name: that May girls become beautiful like the shine of a star; only in use as a first name since around the 16th century','Anna: Der Vorname Anna leitet sich vom biblischen Namen Hannah ab und bedeutet die Begnadete bzw. die Anmutige. Nach der christlichen Überlieferung ist Anna die Mutter der Maria, also die Großmutter Jesu Christi und die Gattin Joachims. Estelle: früher oft Wunschname: das Mädchen möge schön werden wie der Glanz eines Sterns; erst etwa seit dem 16. Jh. als Vorname in Gebrauch ','Anna: Emri i parë Anna rrjedh nga emri biblik Hannah dhe do të thotë e talentuar ose e hijshme. Sipas traditës së krishterë, Anna është nëna e Marisë, gjyshja e Jezu Krishtit dhe gruaja e Joakim. Estelle: përdoret shpesh të jetë emri i dëshiruar: që vajzat Maj të bëhen të bukura si shkëlqimi i një ylli; vetëm në përdorim si emër që nga shekulli i 16-të.'),
            array('Anna Katarina','1','Germany','Anna: in the Bible, Anna is the mother of Mary; Anna is originally the Greek Latin form of HannahKatarina: origin is disputed; the Romans (incorrectly) interpreted the name as belonging to the Greek katharos (=pure) and coined the form Katharina, which is valid today ; spread by the name of St. Catherine of Alexandria (3rd 4th century) ','Anna: in der Bibel ist Anna die Mutter Marias; Anna ist ursprünglich die griechische lateinische Form von HannahKatarina: Herkunft umstritten; die Römer deuteten (fälschlicherweise) den Namen als zu griechisch katharos (=rein) gehörig und prägten die heute gültige Form Katharina; verbreitet durch den Namen der hl. Katharina von Alexandria (3. 4. Jh.)','Anna: në Bibël, Anna është nëna e Marisë; Anna është fillimisht forma greke latine e HannahKatarina: origjina është e diskutueshme; Romakët (gabimisht) e interpretuan emrin si i përket greqishtes katharos (=pastër) dhe shpikën nga Katharina, e cila vlen sot; e përhapur me emrin e Shën Katerinës së Aleksandrisë (shek. III IV)'),
            array('Anna Lina','1','Germany','Anna: in the Bible Anna is the mother of Mary; Anna is originally the Greek Latin form of Hannah Lina: an independent short form of names ending in -lina, especially Karolina ','Anna: in der Bibel ist Anna die Mutter Marias; Anna ist ursprünglich die griechische lateinische Form von Hannah Lina: verselbständigte Kurzform von Namen mit Endung -lina, besonders von Karolina','Anna: në Bibël Anna është nëna e Marisë; Anna është fillimisht forma greke latine e Hannah Lina: një formë e shkurtër e pavarur e emrave që mbarojnë me -lina, veçanërisht Karolina '),
            array('Anna Luna','1','Germany','Unknown','Unbekannt','e panjohur'),
