            array('Ägid','0','Germany','aigis (goat skin) was the name of the protective cloak of Zeus or Athena, also used as a shield, which is why the name can be roughly translated as shield holder. There is also a possible connection with aigilops, an ancient Greek word for a type of oak known by St. Giles, one of the 14 emergency helpers (7th 8th century) ','aigis (Ziegenfell) war die Bezeichnung des Schutzmantels von Zeus oder Athena, auch als Schild gebraucht deshalb kann der Name in etwa übersetzt werden mit Schildhalter möglich ist auch ein Zusammenhang mit aigilops, einem altgriechischen Wort für eine Eichenart bekannt durch den hl. Ägidius, einem der 14 Nothelfer (7. 8. Jh.)','Aigis (lëkura e dhisë) ishte emri i mantelit mbrojtës të Zeusit ose Athinës, i përdorur edhe si mburojë, prandaj emri mund të përkthehet përafërsisht si mbajtës i mburojës. Ekziston edhe një lidhje e mundshme me aigilops, një fjalë greke e lashtë. për një lloj lisi të njohur nga St. Giles, një nga 14 ndihmësit e urgjencës (shekulli 7 8)'),
