            array('Coelestina','1','Germany','Info about the male form Celestine: from the Latin name Celestine or Caelestinus, an extension of Coelestis Caelestis known by the Holy Pope Celestine I (432) so far 5 popes have had the name Celestine or Coelestinus ','Info zur männlichen Form Cölestin: vom lateinischen Namen Coelestinus bzw. Caelestinus, einer Erweiterung von Coelestis Caelestis bekannt durch den hl. Papst Cölestin I. (432) bisher trugen 5 Päpste den Namen Cölestin bzw. Coelestinus','Informacion për formën mashkullore Celestine: nga emri latin Celestine ose Caelestinus, një zgjatim i Coelestis Caelestis i njohur nga Papa i Shenjtë Celestine I (432) deri më tani 5 papë kanë pasur emrin Celestine ose Coelestinus '),
