            array('Conczlin','0','Germany','Medieval male first name, a further development of Kunz','Mittelalterlicher männlicher Vorname, eine Weiterbildung von Kunz','Emri i parë mashkullor mesjetar, një zhvillim i mëtejshëm i Kunz'),
            array('Conni','2','Germany','Unisex first name, short and pet form of names that begin with the element Con- or Kon-, for example Constanze, Cornelia, Konrad, Konstantin, etc.','Unisex-Vorname, Kurz- und Koseform von Namen, die mit dem Element Con- bzw. Kon- beginnen, zum Beispiel Constanze, Cornelia, Konrad, Konstantin usw.','Emri unisex, forma e shkurtër dhe e përkëdhelur e emrave që fillojnë me elementin Con- ose Kon-, për shembull Constanze, Cornelia, Konrad, Konstantin, etj.'),
            array('Conny','2','Germany','Short pet form of Cornelius Cornelia or Konrad Konrada; information about the male form Cornelius: from an ancient Roman family name, which may be based on the word cornu (horn); spread through the veneration of St. Cornelius, Pope from 251 to 253 ; Information about the male form Konrad: old German two-part name, can be interpreted as a bold advisor; in the Middle Ages one of the most popular first names in Germany, therefore also used in the saying Hinz and Kunz ','Kurz- Koseform von Cornelius Cornelia bzw. Konrad Konrada;Info zur männlichen Form Cornelius: von einem altrömischen Familiennamen, dem vielleicht das Wort cornu (Horn) zugrundeliegt; verbreitet durch die Verehrung des hl. Cornelius, Papst von 251 bis 253;Info zur männlichen Form Konrad: alter deutscher zweigliedriger Name, kann interpretiert werden als kühner Ratgeber; im Mittelalter einer der beliebtesten Vornamen in Deutschland, darum auch verwendet in der Redensart Hinz und Kunz ','Forma e shkurtër përkëdhelëse e Cornelius Cornelia ose Konrad Konrada; informacion për formën mashkullore Cornelius: nga një emër i familjes romake të lashtë, i cili mund të bazohet në fjalën cornu (bri); përhapur përmes nderimit të Shën Kornelit, Papa nga 251 deri në 253; Informacion për formën mashkullore Konrad: emër i vjetër gjerman me dy pjesë, mund të interpretohet si një këshilltar i guximshëm; në mesjetë një nga emrat më të njohur në Gjermani, prandaj përdoret edhe në thënien Hinz dhe Kunz '),
            array('Conradin','0','Germany','Pet form of Konrad Konrad is an old German two-part name; can be interpreted as a bold advisor; in the Middle Ages one of the most popular first names in Germany; therefore used in the saying Hinz and Kunz ','Koseform von Konrad Konrad ist ein alter deutscher zweigliedriger Name; kann interpretiert werden als kühner Ratgeber; im Mittelalter einer der beliebtesten Vornamen in Deutschland; darum verwendet in der Redensart Hinz und Kunz','Forma e përkëdhelur e Konrad Konrad është një emër i vjetër gjerman me dy pjesë; mund të interpretohet si një këshilltar i guximshëm; në Mesjetë një nga emrat e parë më të njohur në Gjermani; prandaj përdoret në thënien Hinz dhe Kunz '),
            array('Constanze','1','Germany','Info about the male form Constantine: goes back to a Roman nickname Constantinus; spread by the name of the Roman Emperor Constantine the Great (3rd 4th century)','Info zur männlichen Form Konstantin: geht auf einen römischen Beinamen Constantinus zurück; verbreitet durch den Namen des römischen Kaisers Konstantins des Grossen (3. 4. Jh.)','Informacione rreth formës mashkullore Konstantin: shkon prapa në një pseudonim romak Constantinus; i përhapur me emrin e perandorit romak Konstandin i Madh (shek. III IV)'),
            array('Coppelius','0','Germany','Coppelius is one of the main characters in E. T. A. Hoffmans novel The Sandman','Coppelius ist eine der Hauptfiguren in E. T. A. Hoffmans Roman Der Sandmann','Coppelius është një nga personazhet kryesore në romanin e E. T. A. Hoffman The Sandman'),
            array('Corbinian','0','Germany','Old German male first name, which is mainly known in Bavaria and Austria, is probably the Latin translation of the name Hraban (= raven), which was common in the Middle Ages, extended by the name ending -inianus, known by St. Korbinian, Bishop of Freising (7th 8th century). . century) ','Alter deutscher männlicher Vorname, der vor allem in Bayern und Österreich bekannt ist wahrscheinlich die lateinische Übersetzung des im Mittelalter häufigen Namen Hraban (=Rabe), erweitert um die Namensendung -inianusbekannt durch den hl. Korbinian, Bischof von Freising (7. 8. Jh.)','Emri i parë mashkullor gjerman i vjetër, i cili njihet kryesisht në Bavari dhe Austri, është ndoshta përkthimi latin i emrit Hraban (= korb), i cili ishte i zakonshëm në mesjetë, i zgjatur me mbaresën e emrit -inianus, i njohur nga St. Korbinian, peshkop i Freisingut (shek. VII VIII). .. shek.)'),
            array('Cord Christian','0','Germany','Cord: Low German short form of Conrad or Konrad Christian: used in Germany since the Middle Ages, now one of the most popular first names ','Cord: niederdeutsche Kurzform von Conrad bzw. Konrad Christian: seit dem Mittelalter in Deutschland gebräuchlich, mittlerweile einer der beliebtesten Vornamen','Kordi: Forma e shkurtër gjermane e ulët e Conrad ose Konrad Christian: përdoret në Gjermani që nga Mesjeta, tani një nga emrat e parë më të njohur'),
            array('Cord Eberhard','0','Germany','Cord: Low German short form of Conrad or Konrad Eberhard: old Germanic or German two-part name, the only remnant of an earlier variety of names with the element Eber-','Cord: niederdeutsche Kurzform von Conrad bzw. Konrad Eberhard: alter germanischer bzw. deutscher zweigliedriger Name, einziger Rest einer früheren Vielfalt von Namen mit dem Element Eber-','Kordi: Forma e shkurtër gjermane e ulët e Conrad ose Konrad Eberhard: emër i vjetër gjermanik ose gjerman me dy pjesë, e vetmja mbetje e një shumëllojshmërie emrash të mëhershëm me elementin Eber-'),
            array('Cord Edmund','0','Germany','Cord: Low German short form of Conrad or Konrad Edmund: old English two-part name; adopted from English into German in the 19th century','Cord: niederdeutsche Kurzform von Conrad bzw. Konrad Edmund: alter englischer zweigliedriger Name; im 19. Jh. aus dem Englischen ins Deutsche übernommen','Kordoni: Forma e shkurtër gjermane e ulët e Conrad ose Konrad Edmund: emër i vjetër anglez dypjesësh; i adoptuar nga anglishtja në gjermanisht në shekullin e 19-të.'),
