            array('Elisabeth Maria','1','Germany','Elisabeth: the meaning of the name is not exactly known. Two interpretations are common, depending on the interpretation of the second element of the name as derived from sheba (seven) or from saba (oath): My God is seven with the seven as the symbol of abundance, So My God is abundance or: My God swore in the Bible, Elizabeth is the mother of John the Baptist Mary: as the name of the mother of Jesus, a symbol of pure and deep love; meaning not clarified with certainty; one possibility: bitterness; another possibility is a Egyptian origin and a derivation of mry (the beloved, in the sense of: the one who is loved the one who is loved); Mary is the Greek Latin original form, Miriam the older Aramaic Hebrew; probably the am most widespread Christian female name ','Elisabeth: die Bedeutung des Namens ist nicht genau bekannt zwei Deutungen sind verbreitet, je nach Interpretation des 2. Namenselements als abgeleitet von scheba (sieben) oder von saba (Schwur): Mein Gott ist Sieben mit der Sieben als dem Sinnbild für Fülle, also Mein Gott ist Fülle oder: Mein Gott hat geschworen in der Bibel ist Elisabeth die Mutter Johannes des Täufers Maria: als Name der Mutter Jesu Symbol für reine und tiefe Liebe; Bedeutung nicht sicher geklärt; eine Möglichkeit: Verbitterung; eine andere Möglichkeit ist ein ägyptischer Ursprung und eine Ableitung von mry (die der Geliebte, im Sinne von: die, welche geliebt wird der, welcher geliebt wird); Maria ist die griechische lateinische Ursprungs-Form, Mirjam die ältere aramäische hebräische; wohl der am weitesten verbreitete christliche weibliche Name ','Elisabeth: kuptimi i emrit nuk dihet saktësisht. Dy interpretime janë të zakonshme, në varësi të interpretimit të elementit të dytë të emrit si rrjedh nga sheba (shtatë) ose nga saba (betimi): Zoti im është shtatë me shtatë. si simbol i bollëkut, pra Zoti im është bollëk ose: Zoti im u betua në Bibël, Elizabeta është nëna e Gjon Pagëzorit Marisë: si emri i nënës së Jezusit, simbol i dashurisë së pastër dhe të thellë; që do të thotë e paqartë me siguri; një mundësi: hidhërim; një mundësi tjetër është origjina egjiptiane dhe prejardhja e mry (i dashur, në kuptimin: ai që është i dashur   ai që është i dashur); Maria është forma origjinale greke   latine, Miriam, aramaishtja hebraishtja më e vjetër; ndoshta është emri femëror më i përhapur i krishterë '),
