            array('Ettalia','1','Germany','Composition of Etta and Lia; Etta: Subform of Edda; either a short form of names that begin with \u00a7Ed- such as Edeltraut (Old High German adal (= noble) or a short form of names that end in -etta, such as Henrietta; it is also possible to be related to the Frisian names Tibeta (= the people) or Ettina (= the noble one); Lia: Greek-Latin form of Lea or short form of names ending in -lia','Zusammensetzung aus Etta und Lia;Etta: Nebenform von Edda; entweder eine Kurzform von Namen, die mit \u00a7Ed- beginnen wie z. B. Edeltraut (althochdt. adal (=edel) oder Kurzform von Namen, die auf -etta enden, wie z. B. Henrietta; möglich ist auch eine Verwandtschaft zu den friesischen Namen Tibeta (= das Volk) oder Ettina (= die Edle);Lia: griechisch-lateinische Form von Lea oder Kurzform von Namen mit der Endung-lia','Përbërja e Etta dhe Lia; Etta: Nënforma e Edda; ose një formë e shkurtër emrash që fillojnë me \u00a7Ed- si p.sh. Edeltraut (gjermanishtja e vjetër e lartë adal (= fisnik) ose një formë e shkurtër emrash që mbarojnë me -etta, si p.sh. si Henrietta; është gjithashtu e mundur të lidhet me emrat frizian Tibeta (= populli) ose Ettina (= fisniku); Lia: forma greko-latine e Lea ose forma e shkurtër e emrave që mbarojnë me -lia'),
            array('Eugen','0','Germany','Became known in Germany in the 18th century by Prince Eugene of Savoy; so far four popes have had the name Eugen or Eugenius','In Deutschland im 18. Jh. bekanntgeworden durch Prinz Eugen von Savoyen; bisher trugen 4 Päpste den Namen Eugen bzw. Eugenius','U bë i njohur në Gjermani në shekullin e 18-të nga Princi Eugene i Savojës; deri më tani katër papë kanë pasur emrin Eugen ose Eugenius'),
