            array('Ev Marie','1','Germany','Ev: became known in Germany in the 18th century by Prince Eugene of Savoy. To date, 4 popes have had the name Eugen or Eugenius Marie: as the name of the mother of Jesus, a symbol of pure and deep love. Meaning not clarified with certainty; one possibility: bitterness, another Possibility is an Egyptian origin and a derivation of mry (the beloved, in the sense of: the one who is loved the one who is loved). Mary is the Greek Latin original form, Miriam the older Aramaic Hebrew probably the most widespread Christian female name ','Ev: in Deutschland im 18. Jh. bekanntgeworden durch Prinz Eugen von Savoyen bisher trugen 4 Päpste den Namen Eugen bzw. EugeniusMarie: als Name der Mutter Jesu Symbol für reine und tiefe Liebe Bedeutung nicht sicher geklärt; eine Möglichkeit: Verbitterung eine andere Möglichkeit ist ein ägyptischer Ursprung und eine Ableitung von mry (die der Geliebte, im Sinne von: die, welche geliebt wird der, welcher geliebt wird) Maria ist die griechische lateinische Ursprungs-Form, Mirjam die ältere aramäische hebräische wohl der am weitesten verbreitete christliche weibliche Name ','Ev: u bë i njohur në Gjermani në shekullin e 18-të nga Princi Eugene i Savojës. Deri më sot, 4 papë kanë pasur emrin Eugen ose Eugenius Marie: si emrin e nënës së Jezusit, simbol i dashurisë së pastër dhe të thellë. Do të thotë jo e sqaruar me siguri; një mundësi: hidhërim, një tjetër Mundësia është origjinë egjiptiane dhe prejardhje e mry (i dashur, në kuptimin: ai që është i dashur   ai që është i dashur). Mary është forma origjinale greke   latine. , Miriam, aramaishtja hebraishtja më e vjetër, ndoshta emri femëror më i përhapur i krishterë '),
