            array('Franko','0','Germany','The tribe name is derived from frank, an old Germanic word for free, as in frank and free ev. but the Franks were named after their characteristic weapon, the Francisca (Latin securis francisca, a type of throwing ax) ','Der Stammesname leitet sich ev. ab von frank, einem alten germanischen Wort für frei, wie in frank und frei ev. aber wurden die Franken benannt nach ihrer charakteristischen Waffe, der Francisca (lateinisch securis francisca, eine Art Wurfbeil)','Emri i fisit rrjedh nga frank, një fjalë e vjetër gjermanike falas, si në të sinqertë dhe të lirë ev. por frankët u emëruan sipas armës së tyre karakteristike, Francisca (latinisht securis francisca, një lloj sëpatë hedhëse) '),
