            array('Franz Josef','0','Germany','Franz: originated as the nickname Francesco (little Frenchman, little Frenchman) by Giovanni Bernardone, known as St. Francis of Assisi, the German form Franziskus is a Latinization of this Italian nickname, the common first name Franz in turn is a shortened form of it Josef: the name is interpreted as May God add another son in the Old Testament, Joseph is the eleventh son of Jacob, advisor to the Pharaoh in Egypt, and thus also the name of one of the twelve tribes of Israel in the New Testament, Joseph is the husband of Mary, the mother of Jesus ','Franz: entstanden als Spitzname Francesco (kleiner Franzose, Französlein) von Giovanni Bernardone, bekannt als hl. Franziskus von Assisi die deutsche Form Franziskus ist eine Latinisierung dieses italienischen Spitznamens, der verbreitete Vorname Franz wiederum eine Kurzform davonJosef: der Name wird interpretiert als Gott möge noch einen Sohn hinzufügen im Alten Testament ist Josef der elfte Sohn Jakobs, Berater des Pharaos in Ägypten, und damit auch der Name eines der zwölf Stämme Israels im Neuen Testament ist Josef der Ehemann von Maria, der Mutter Jesu','Franz: e ka origjinën si pseudonimi Francesco (Françesku i vogël, francezi i vogël) nga Giovanni Bernardone, i njohur si Shën Françesku i Asizit, forma gjermane Franziskus është një latinizim i këtij pseudonimi italian, emri i zakonshëm Franz nga ana tjetër është një formë e shkurtuar. prej tij Josef: emri interpretohet si Zoti shtoftë një djalë tjetër në Dhiatën e Vjetër, Jozefi është djali i njëmbëdhjetë i Jakobit, këshilltar i Faraonit në Egjipt, dhe kështu edhe emri i njërit prej dymbëdhjetë fiseve të Izraelit në Dhiatën e Re Testament, Jozefi është burri i Marisë, nënës së Jezusit'),
