            array('Hilde Marie','1','Germany','Hilde: old German two-part name, spread through the veneration of St. Hildegard of Bingen (11th 12th century). Marie: as the name of the mother of Jesus, symbol of pure and deep love; meaning not clarified with certainty; one possibility: bitterness , another possibility is an Egyptian origin and a derivation of mry (the beloved, in the sense of: the one who is loved the one who is loved); Mary is the Greek Latin origin form, Miriam the older Aramaic  Hebrew; probably the most widespread Christian female name ','Hilde: alter deutscher zweigliedriger Name, verbreitet durch die Verehrung der hl. Hildegard von Bingen (11. 12. Jh.)Marie: als Name der Mutter Jesu Symbol für reine und tiefe Liebe; Bedeutung nicht sicher geklärt; eine Möglichkeit: Verbitterung, eine andere Möglichkeit ist ein ägyptischer Ursprung und eine Ableitung von mry (die der Geliebte, im Sinne von: die, welche geliebt wird der, welcher geliebt wird); Maria ist die griechische lateinische Ursprungs-Form, Mirjam die ältere aramäische hebräische; wohl der am weitesten verbreitete christliche weibliche Name ','Hilde: emër i vjetër gjerman me dy pjesë, i përhapur përmes nderimit të Shën Hildegardës së Bingenit (shek. 11 12). Marie: si emri i nënës së Jezusit, simbol i dashurisë së pastër dhe të thellë; që do të thotë i paqartë me siguri ; një mundësi: hidhërim, një mundësi tjetër është origjina egjiptiane dhe prejardhja e mry (i dashur, në kuptimin: ai që është i dashur   ai që është i dashur); Maria është forma me origjinë greke   latine, Miriam më i vjetër aramaik   hebraik; ndoshta emri femëror më i përhapur i krishterë '),
