            array('Horsa','0','Old-German','Perhaps from an Old High German word for bushes, undergrowth or perhaps from Horsa, who according to a legend was said to have been the leader of the first Germanic settlers in England together with Hengist. The name Horsa probably means horse. For a long time it was not very common, but only became popular in more recent times ','Vielleicht von einem althochdeutschen Wort für Gebüsch, Unterholz oder vielleicht von Horsa, der gemäss einer Sage zusammen mit Hengist der Anführer der ersten germanischen Siedler in England gewesen sein soll der Name Horsa bedeutet vermutlich Pferd lange Zeit wenig verbreitet, wurde erst in neuerer Zeit beliebt','Ndoshta nga një fjalë e vjetër gjermane e lartë për shkurre, drithëra ose ndoshta nga Horsa, që sipas një legjende thuhet se ka qenë udhëheqësi i kolonëve të parë gjermanikë në Angli së bashku me Hengistin. Emri Horsa ndoshta do të thotë kal. Për një kohë të gjatë koha nuk ishte shumë e zakonshme, por u bë e njohur vetëm në kohët më të fundit'),
