            array('Jakobea','1','Germany','Female form of JacobInfo on the male form Jacob: Meaning actually He (God) may protect, but already in the Old Testament it was interpreted in folk etymology as a heel holder and he cheats he represses; in the Old Testament Jacob is a son of Isaac and the father of 12 sons, which founded the 12 tribes of Israel. Jacob is said to have held his twin brother Esau by the heel during birth in order to become the firstborn (hence the above name interpretations); in the New Testament, James the Younger and James the Elder are two apostles of Jesus.',' weibliche Form von JakobInfo zur männlichen Form Jakob: Bedeutung eigentlich Er (Gott) möge schützen, aber bereits im Alten Testament volksetymologisch gedeutet als Fersenhalter und er betrügt er verdrängt; im Alten Testament ist Jakob ein Sohn Isaaks und der Vater von 12 Söhnen, welche die 12 Stämme Israels begründen. Jakob soll bei der Geburt seinen Zwillingsbruder Esau an der Ferse festgehalten haben, um zum Erstgeborenen zu werden (daher obige Namensdeutungen); im Neuen Testament sind Jakobus der Jüngere und Jakobus der Ältere zwei Apostel Jesu.','Forma femërore e JacobInfo në formën mashkullore Jacob: Do të thotë në të vërtetë Ai (Zoti) mund të mbrojë, por tashmë në Testamentin e Vjetër është interpretuar në etimologjinë popullore si mbajtëse thembra dhe ai mashtron   ai shtyp; në Dhiatën e Vjetër Jakobi është një i biri i Isakut dhe babai i 12 djemve, që themeluan 12 fiset e Izraelit. Thuhet se Jakobi e kishte mbajtur vëllain e tij binjak Esau për thembra gjatë lindjes, në mënyrë që të bëhej i parëlinduri (prandaj interpretimi i emrit të mësipërm); në të Re Testament, Jakobi i Ri dhe Jakobi i Plaku janë dy apostuj të Jezusit.'),
