            array('Joringel','0','Germany','Invented by the Brothers Grimm for their fairy tale Jorinde and Joringel; while Jorinde can be derived from Georg, there is no direct translation for Joringel, although many see a connection to themselves ringing or the rings of ornamental birds (turtle doves)','Von den Gebrüdern Grimm erfunden für ihr Märchen Jorinde und Joringel; während Jorinde von Georg abgeleitet werden kann, gibt es für Joringel keine direkte Übersetzung, allerdings sehen viele eine Beziehung zu sich ringeln bzw. den Ringen von Ziervögeln (Turteltauben)','I shpikur nga Vëllezërit Grimm për përrallën e tyre Jorinde dhe Joringel; ndërsa Jorinde mund të rrjedhë nga Georg, nuk ka asnjë përkthim të drejtpërdrejtë për Joringel, edhe pse shumë shohin një lidhje me veten e tyre që kumbojnë ose unazat e zogjve zbukurues (breshkave)'),
