            array('Jutta','1','Germany','Female first name with Hebrew origin, variant of Judith The meaning woman from Jehud refers to the city of Jehud in Israel. The name could also have meant a member of the tribe of Judah and therefore a Jew. In the Bible, Judith is one of the wives of Esau; below Among the apocryphal writings there is also a book of Judith.','Weiblicher Vorname mit hebräischem Ursprung, Variante von Judith Die Bedeutung Frau aus Jehud bezieht sich auf die Stadt Jehud in Israel. Der Name könnte auch Angehörige des Stammes Juda und damit Jüdin bedeutet haben. In der Bibel ist Judith eine der Frauen von Esau; unter den apokryphen Schriften gibt es zudem ein Buch Judith.','Emri i parë femër me origjinë hebraike, variant i Judith Kuptimi grua nga Jehud i referohet qytetit Jehud në Izrael. Emri mund të nënkuptojë gjithashtu një anëtar të fisit të Judës dhe për rrjedhojë një çifut. Në Bibël, Judith është një i grave të Esaut; poshtë ndër shkrimet apokrife ka edhe një libër të Juditës.'),
