            array('Karlotta','1','Germany','Diminutive form of Charles and therefore (also) a female form of Karl Info on the male form Karl: old German name known early in Germany, e.g. by Charlemagne (8th 9th century) but was only used in the 19th century . popular in Germany','Verkleinerungsform von Charles und damit (auch) eine weibliche Form von KarlInfo zur männlichen Form Karl: alter deutscher Name früh in Deutschland bekannt, z.B. durch Karl den Grossen (8. 9.. Jh.) wurde aber erst im 19. Jh. in Deutschland beliebt ','Forma zvogëluese e Charles dhe për rrjedhojë (gjithashtu) një formë femërore e Karl Info në formën mashkullore Karl: emër i vjetër gjerman i njohur herët në Gjermani, p.sh. nga Charlemagne (shekulli 8 9\'), por u përdor vetëm në shekullin e 19-të. popullor në Gjermani'),
