            array('Karo','2','Germany','Kurdish male first name or female short and pet form of names that begin with the element Karo- or Caro-, for example Karoline','Kurdischer männlicher Vorname oder weibliche Kurz- und Koseform von Namen, die mit dem Element Karo- bzw. Caro- beginnen, zum Beispiel Karoline','Emri i parë mashkull kurd ose forma e shkurtër dhe e përkëdhelur femërore e emrave që fillojnë me elementin Karo- ose Caro-, për shembull Karoline'),
            array('Karola','1','Germany','Variant of Carola, female form of Carolus, the Latinized form of Karl The English variant Carol is usually given based on the English word carol (Christmas song). Info on the male form Karl: old German name, known early in Germany, e.g. by Charlemagne (8th 9th century\'), but only became popular in Germany in the 19th century','Variante von Carola, weibliche Form von Carolus, der latinisierten Form von Karl Die englische Variante Carol dürfte meistens in Anlehnung an das englische Wort carol (Weihnachtslied) vergeben werden.Info zur männlichen Form Karl: alter deutscher Name, früh in Deutschland bekannt, z.B. durch Karl den Grossen (8. 9.. Jh.\'), wurde aber erst im 19. Jh. in Deutschland beliebt ','Varianti i Carola, forma femërore e Carolus, forma e latinizuar e Karlit Varianti anglez Carol zakonisht jepet bazuar në fjalën angleze carol (këngë e Krishtlindjeve). Informacion mbi formën mashkullore Karl: emër i vjetër gjerman, i njohur herët në Gjermani, p.sh. nga Karli i Madh (shekulli 8 9\'), por u bë i njohur në Gjermani vetëm në shekullin e 19-të.'),
            array('Karolin','1','Germany','The English variant Carol is usually based on the English word carol (Christmas song). Information about the male form Karl: old German name known early in Germany, e.g. by Charlemagne (8th 9th century). only popular in Germany in the 19th century','Die englische Variante Carol dürfte meistens in Anlehnung an das englische Wort carol (Weihnachtslied) vergeben werdenInfo zur männlichen Form Karl: alter deutscher Name früh in Deutschland bekannt, z.B. durch Karl den Grossen (8. 9.. Jh.) wurde aber erst im 19. Jh. in Deutschland beliebt ','Varianti anglez Carol zakonisht bazohet në fjalën angleze carol (kënga e Krishtlindjeve). Informacion rreth formës mashkullore Karl: emër i vjetër gjerman i njohur herët në Gjermani, p.sh. nga Charlemagne (shek. 8 9). popullor vetëm në Gjermani në shekullin e 19-të shekulli'),
            array('Karoline','1','Germany','The English variant Carol is usually given based on the English word carol (Christmas song); information about the male form Karl: old German name known early in Germany, e.g. by Charlemagne (8th 9th century\'), but only became popular in Germany in the 19th century','Die englische Variante Carol dürfte meistens in Anlehnung an das englische Wort carol (Weihnachtslied) vergeben werden; Info zur männlichen Form Karl: alter deutscher Name früh in Deutschland bekannt, z.B. durch Karl den Grossen (8. 9.. Jh.), wurde aber erst im 19. Jh. in Deutschland beliebt ','Varianti anglez Carol zakonisht jepet bazuar në fjalën angleze carol (kënga e Krishtlindjeve); informacione për formën mashkullore Karl: emër i vjetër gjerman i njohur herët në Gjermani, p.sh. nga Charlemagne (shekulli 8 9\'), por u bë i njohur vetëm në Gjermani. në shekullin e 19-të'),
            array('Karsta','1','Germany','Info about the male form Christian: used in Germany since the Middle Ages, now one of the most popular first names','Info zur männlichen Form Christian: seit dem Mittelalter in Deutschland gebräuchlich, mittlerweile einer der beliebtesten Vornamen','Informacione rreth formës mashkullore të krishterë: përdoret në Gjermani që nga Mesjeta, tani një nga emrat më të njohur.'),
            array('Kaspian','0','Germany','Known by The Chronicles of Narnia, in the original Caspian, in the German translation Caspian','Bekannt durch Die Chroniken von Narnia, im Original Caspian, in der deutschen Übersetzung Kaspian','I njohur nga Kronikat e Narnias, në origjinalin Kaspian, në përkthimin gjermanisht Kaspian'),
            array('Kassia','1','Germany','Female form of Cassian, a derivative of the ancient Roman surname Cassius','Weibliche Form von Kassian, einer Ableitung des alten römischen Familiennamens Cassius','Forma femërore e Cassian, një derivat i mbiemrit të lashtë romak Cassius'),
            array('Kassian','0','Germany','Kassian is a minor form of the male first name Cassius, which is based on a Latin family name.','Kassian ist eine Nebenform des männlichen Vornamens Cassius, der an einen lateinischen Familiennamen angelehnt ist.','Kassian është një formë e vogël e emrit të parë mashkullor Cassius, i cili bazohet në një emër të familjes latine.'),
            array('Kassiopeia','1','Germany','Meaning possibly cassia juice (cassia is the cinnamon plant\'), in Greek mythology Cassiopeia is the mother of Andromeda; she was transformed into a constellation','Bedeutung möglicherweise Kassia-Saft (Kassia ist die Zimt-Pflanze), in der griechischen Mythologie ist Kassiopeia die Mutter von Andromeda; sie wurde in ein Sternbild verwandelt','Në kuptimin e mundshëm të lëngut të kasias (kasia është bima e kanellës), në mitologjinë greke Cassiopeia është nëna e Andromedës; ajo u shndërrua në një plejadë.'),
            array('Kassius','0','Germany','Germanized variant of Kassius, an originally Roman family name, possibly derived from cassus (=empty, vain)','Eingedeutschte Variante von Kassius, einem ursprünglich römischen Familiennamen, möglicherweise abgeleitet von cassus (=leer, eitel) ','Variant i gjermanizuar i Kassius, një emër familjar fillimisht romak, ndoshta rrjedhur nga cassus (=bosh, i kotë)'),
