            array('Katharina','1','Germany','Female first name with ancient Greek origin; the Romans interpreted the name as belonging to the Greek katharos (=pure) and coined the form Katharina, which is valid today. Spread through the name of St. Catherine of Alexandria (3rd 4th century).','Weiblicher Vorname mit altgriechischem Ursprung; die Römer deuteten den Namen als zu griechisch katharos (=rein) gehörig und prägten die heute gültige Form Katharina. Verbreitet durch den Namen der hl. Katharina von Alexandria (3. 4. Jh.).','Emri i parë femër me origjinë greke të lashtë; Romakët e interpretuan emrin si të greqishtes katharos (=i pastër) dhe krijuan formën Katharina, e cila vlen edhe sot. Përhapet përmes emrit të Shën Katerinës së Aleksandrisë (shek. III IV. )'),
            array('Kathena','1','Germany','Re-creation combination of Katharina and Helena','Neuschöpfung Zusammenfügung aus Katharina und Helena ','Rikrijimi kombinimi i Katharinës dhe Helenës'),
            array('Katherina','1','Germany','Origin disputed; the Romans (incorrectly) interpreted the name as belonging to the Greek katharos and coined the form Katharina, which is valid today; spread by the name of St. Catherine of Alexandria (3rd 4th century)','Herkunft umstritten; die Römer deuteten (fälschlicherweise) den Namen als zu griechisch katharos gehörig und prägten die heute gültige Form Katharina; verbreitet durch den Namen der hl. Katharina von Alexandria (3. 4. Jh.)','Origjina e diskutueshme; Romakët (gabimisht) e interpretuan emrin se i përkiste greqishtes katharos dhe krijuan formën Katharina, e cila është e vlefshme sot; përhapur me emrin e Shën Katerinës së Aleksandrisë (shek. III IV)'),
            array('Kathina','1','Germany','One of the many variants of Katharina (Kati, Katrina)','Eine der vielen Varianten von Katharina (Kati, Katrina)','Një nga variantet e shumta të Katharina (Kati, Katrina)'),
            array('Kathrein','1','Germany','South German, Austrian short form of Katharina','Süddeutsche, österreichische Kurzform von Katharina ','Forma e shkurtër gjermano-jugore, austriake e Katharina'),
            array('Kathrin','1','Germany','Origin disputed; the Romans (incorrectly) interpreted the name as belonging to the Greek katharos and coined the form Katharina, which is valid today; spread by the name of St. Catherine of Alexandria (3rd 4th century)','Herkunft umstritten; die Römer deuteten (fälschlicherweise) den Namen als zu griechisch katharos gehörig und prägten die heute gültige Form Katharina; verbreitet durch den Namen der hl. Katharina von Alexandria (3. 4. Jh.)','Origjina e diskutueshme; Romakët (gabimisht) e interpretuan emrin se i përkiste greqishtes katharos dhe krijuan formën Katharina, e cila është e vlefshme sot; përhapur me emrin e Shën Katerinës së Aleksandrisë (shek. III IV)'),
            array('Kathrina','1','Germany','Origin disputed; the Romans (incorrectly) interpreted the name as belonging to the Greek katharos and coined the form Katharina, which is valid today; spread by the name of St. Catherine of Alexandria (3rd 4th century)','Herkunft umstritten; die Römer deuteten (fälschlicherweise) den Namen als zu griechisch katharos gehörig und prägten die heute gültige Form Katharina; verbreitet durch den Namen der hl. Katharina von Alexandria (3. 4. Jh.)','Origjina e diskutueshme; Romakët (gabimisht) e interpretuan emrin se i përkiste greqishtes katharos dhe krijuan formën Katharina, e cila është e vlefshme sot; përhapur me emrin e Shën Katerinës së Aleksandrisë (shek. III IV)'),
            array('Kathrine','1','Germany','Origin is disputed; the Romans (incorrectly) interpreted the name as belonging to the Greek katharos and coined the form Katharina, which is valid today, spread by the name of St. Catherine of Alexandria (3rd 4th century)','Herkunft umstritten; die Römer deuteten (fälschlicherweise) den Namen als zu griechisch katharos gehörig und prägten die heute gültige Form Katharina verbreitet durch den Namen der hl. Katharina von Alexandria (3. 4. Jh.)','Origjina është e diskutueshme; Romakët (gabimisht) e interpretuan emrin se i përkiste greqishtes katharos dhe shpikën formën Katharina, e cila vlen sot, e përhapur me emrin e Shën Katerinës së Aleksandrisë (shek. III IV)'),
            array('Kati','1','Germany','Short pet form of Katharina','Kurz- Koseform von Katharina','Forma e shkurtër përkëdhelëse e Katharinës'),
            array('Katoli','1','Germany','The name became known through the character Katoli from the animated film series The Girl from the Farm, which takes place in Finland; in the book by a Finnish author the girl is called Katri > Little steadfast Katri; also in the English version of the series; probably invented by the Japanese illustrators and German translators','Name wurde bekannt durch die Figur Katoli aus der Trickfilmserie Das Mädchen von der Farm, die in Finnland spielt; in der Buchvorlage einer finnischen Autorin heißt das Mädchen Katri > Kleine standhafte Katri ebenso in der englischen Fassung der Serie; wahrscheinlich erfunden von den japanischen Zeichnern bzw. deutschen Übersetzern','Emri u bë i njohur përmes personazhit Katoli nga seria e filmave të animuar The Girl from the Farm, i cili zhvillohet në Finlandë; në librin e një autori finlandez vajza quhet Katri > Katri e vogël e palëkundur; gjithashtu në versionin anglisht të seri; ndoshta e shpikur nga ilustruesit japonezë dhe përkthyesit gjermanë'),
            array('Katsa','1','Germany','Short form of Katharina','Kurzform von Katharina','Forma e shkurtër e Katarinës'),
            array('Katyna','1','Germany','Variation of Katharina','Abwandlung von Katharina','Variacioni i Katarinës'),
            array('Kaye','1','Germany','Female form or variant of Kay','Weibliche Form bzw. Variante von Kay','Forma femërore ose varianti i Kay'),
            array('Käte','1','Germany','Short form of Katharina','Kurzform von Katharina','Forma e shkurtër e Katarinës'),
            array('Käthe','1','Germany','The first name Käthe is a short form of Katharina. The origin is controversial; the Romans (incorrectly) interpreted the name as belonging to the Greek katharos and coined the form Katharina, which is valid today; spread through the name of St. Catherine of Alexandria (3.  4th century) ','Der Vorname Käthe ist eine Kurzform von Katharina. Die Herkunft ist umstritten; die Römer deuteten (fälschlicherweise) den Namen als zu griechisch katharos gehörig und prägten die heute gültige Form Katharina; verbreitet durch den Namen der hl. Katharina von Alexandria (3. 4. Jh.)','Emri i parë Käthe është një formë e shkurtër e Katharina. Origjina është e diskutueshme; romakët (gabimisht) e interpretuan emrin se i përkiste greqishtes katharos dhe krijuan formën Katharina, e cila është e vlefshme sot; u përhap përmes emrit të Shën Katerinës. i Aleksandrisë (shek. 3.  IV) '),
            array('Käthie','1','Germany','The pure','Die Reine','E pastër'),
            array('Kea','1','Germany','East Frisian girls name, which consists of the ending of Latinized names such as Alke (> Alkea) or Frauke (> Fraukea)','Ostfriesischer Mädchenname, der aus der Endung von latinisierten Namen wie Alke (> Alkea) oder Frauke (> Fraukea) besteht','Emri i vajzës friziane lindore, i cili përbëhet nga mbaresa e emrave të latinizuar si Alke (> Alkea) ose Frauke (> Fraukea)'),
            array('Keanaja','1','Germany','Name is composed of Kea (a Greek island) and the Latin expression for snake = well; Pronounced Kienaja','Name ist zusammengesetzt aus Kea (einer griechischen Insel) und dem lateinischen Ausdruck für Schlange = naja; Gesprochen Kienaja','Emri përbëhet nga Kea (një ishull grek) dhe shprehja latine për gjarpër = mirë; shqiptohet Kienaja'),
            array('Keke','2','Germany','Can be seen as both a Finnish first name (for racing driver Keke Rosberg it is a pet form for his real first name Keijo Erik) and as a Frisian short form of Christian','Kann sowohl als finnischer Vorname angesehen werden (bei dem Rennfahrer Keke Rosberg ist es eine Koseform für seine richtigen Vornamen Keijo Erik\'), als auch als friesische Kurzform von Christian','Mund të shihet si një emër i parë finlandez (për shoferin e garave Keke Rosberg është një formë përkëdhelëse për emrin e tij të parë Keijo Erik) dhe si një formë e shkurtër friziane e të krishterëve'),
            array('Kerrin','1','Germany','Kerrin is a Frisian derivation of Karin and therefore a short form of Katharina. Origin is disputed; the Romans (incorrectly) interpreted the name as belonging to the Greek katharos and coined the form Katharina, which is valid today; spread by the name of St. Catherine of Alexandria ( 3rd 4th century) ','Kerrin ist eine friesische Ableitung von Karin und daher eine Kurzform von Katharina.Herkunft umstritten; die Römer deuteten (fälschlicherweise) den Namen als zu griechisch katharos gehörig und prägten die heute gültige Form Katharina; verbreitet durch den Namen der hl. Katharina von Alexandria (3. 4. Jh.)','Kerrin është një prejardhje friziane e Karin dhe për këtë arsye një formë e shkurtër e Katharina. Origjina është e diskutueshme; romakët (gabimisht) e interpretuan emrin se i përkiste greqishtes katharos dhe shpikën formën Katharina, e cila është e vlefshme sot; përhapur me emrin Shën Katerina e Aleksandrisë (shek. III IV) '),
            array('Kersta','2','Germany','Swedish subsidiary form of Kerstin or Frisian, Nordic form of Karsten Christian','Schwedische Nebenform von Kerstin bzw.friesische, nordische Form von Karsten Christian','Forma ndihmëse suedeze e Kerstin ose friziane, forma nordike e Karsten kristiane'),
            array('Kersten','2','Germany','Low German form of Karsten Christian; used in Germany since the Middle Ages, now one of the most popular first names','Niederdt. Form von Karsten Christian; seit dem Mittelalter in Deutschland gebräuchlich, mittlerweile einer der beliebtesten Vornamen','Forma e ulët gjermane e Karsten Kristian; përdoret në Gjermani që nga Mesjeta, tani një nga emrat e parë më të njohur.'),
            array('Kerstina','1','Germany','Combination of the Frisian and Swedish form of Christine and the variant Christina','Kombination aus der fries. und schwedischen Form von Christine und der Variante Christina','Kombinimi i formës friziane dhe suedeze të Christine dhe variantit Christina'),
            array('Kessia','1','Germany','In the Bible, Keziah is one of Jobs daughters','In der Bibel ist Kezia eine der Töchter Hiobs','Në Bibël, Keziah është një nga vajzat e Jobit.'),
            array('Kessy','1','Germany','Germanized form of Cassie or Casey','Eingedeutschte Form von Cassie oder Casey','Forma e gjermanizuar e Cassie ose Casey'),
            array('Ketrin','1','Germany','Variant of the Dutch girls name Ketrien, a form of Katrin Katharina','Variante des niederländischen Mädchennamens Ketrien, einer Form von Katrin Katharina','Variant i emrit të vajzës holandeze Ketrien, një formë e Katrin Katharina'),
            array('Kilia','1','Germany','Possibly the invented female form of Kilian','Womöglich die erfundene weibliche Form von Kilian','Ndoshta forma femërore e shpikur e Kilian'),
            array('Kilian','0','Germany','Male first name with Celtic origin, derived from ceallach (= war, fight, fighter); known by St. Kilian, an Irish missionary in Franconia in the 7th century, bishop of Würzburg and patron saint of the Franks. The name is therefore special has been widespread in Franconia and southern Germany for a long time.','Männlicher Vorname mit keltischem Ursprung, abgeleitet von ceallach (=Krieg, Kampf, Kämpfer); bekannt durch den hl. Kilian, einem irischen Missionar in Franken im 7. Jh., Bischof von Würzburg und Schutzpatron der Franken. Der Name ist deshalb besonders in Franken bzw. Süddeutschland schon seit langem verbreitet.','Emri i parë mashkullor me origjinë kelte, rrjedh nga ceallach (= luftë, luftë, luftëtar); i njohur nga Shën Kilian, një misionar irlandez në Frankoni në shekullin e VII, peshkop i Würzburgut dhe shenjt mbrojtës i Frankëve. Prandaj emri është special ka qenë i përhapur në Frankoni dhe Gjermaninë jugore për një kohë të gjatë.'),
            array('Kim Marie','1','Germany','Kim: Russian, Norwegian, Swedish short form of Joachim; in apocryphal writings, Joachim is the husband of St. Anna, the mother of Mary Marie: as the name of the mother of Jesus, symbol of pure and deep love. Meaning not clarified with certainty; one possibility : Bitterness another possibility is an Egyptian origin and a derivation of mry (the beloved, in the sense of: the one who is loved the one who is loved) Mary is the Greek Latin origin form, Miriam the older Aramaic  Hebrew probably the most widespread Christian female name ','Kim: russ., norweg., schwed. Kurzform von Joachim; in apokryphen Schriften ist Joachim der Mann der hl. Anna, der Mutter MariasMarie: als Name der Mutter Jesu Symbol für reine und tiefe Liebe Bedeutung nicht sicher geklärt; eine Möglichkeit: Verbitterung eine andere Möglichkeit ist ein ägyptischer Ursprung und eine Ableitung von mry (die der Geliebte, im Sinne von: die, welche geliebt wird der, welcher geliebt wird) Maria ist die griechische lateinische Ursprungs-Form, Mirjam die ältere aramäische hebräische wohl der am weitesten verbreitete christliche weibliche Name ','Kim: Forma e shkurtër ruse, norvegjeze, suedeze e Joachimit; në shkrimet apokrife, Joachim është burri i Shën Anës, nënës së Mary Marie: si emri i nënës së Jezusit, simbol i dashurisë së pastër dhe të thellë. Do të thotë jo sqaruar me siguri; një mundësi : Hidhërimi një tjetër mundësi është origjina egjiptiane dhe prejardhja e mry (i dashur, në kuptimin: ai që është i dashur   ai që është i dashur) Maria është forma e origjinës greke latinike, Miriam më i vjetër aramaik hebraisht, ndoshta emri femëror më i përhapur i krishterë '),
            array('Kirstin','1','Germany','Variant from ChristianeInfo on the male form Christian: used in Germany since the Middle Ages, now one of the most popular first names ','Variante von ChristianeInfo zur männlichen Form Christian: seit dem Mittelalter in Deutschland gebräuchlich, mittlerweile einer der beliebtesten Vornamen','Variant nga ChristianeInfo në formën mashkullore Christian: përdoret në Gjermani që nga Mesjeta, tani një nga emrat më të njohur'),
            array('Kjara','1','Germany','Germanized or Norwegian form of the Italian female first name Chiara; only approved as a name for a few years; derived from Klara or Clara','Eingedeutschte bzw. norwegische Form des italienischen weiblichen Vornamens Chiara; erst wenige Jahre als Name zugelassen;abgeleitet von Klara bzw. Clara','Forma e gjermanizuar ose norvegjeze e emrit të parë femëror italian Chiara; e miratuar si emër vetëm për disa vjet; rrjedh nga Klara ose Clara'),
            array('Klaas','0','Germany','Dutch or Low German short form of Nikolaus','Niederländische bzw. niederdeutsche Kurzform von Nikolaus','Forma e shkurtër holandeze ose gjermane e ulët e Nikolaus'),
            array('Klarina','1','Germany','Variant or further development of Klara, similar name forms are Klarinda, Klarine, Klarinde','Variante bzw. Weiterbildung von Klara, ähnliche Namensformen sind Klarinda, Klarine, Klarinde','Variant ose zhvillim i mëtejshëm i Klarës, forma të ngjashme emrash janë Klarinda, Klarine, Klarinde'),
            array('Klarinda','1','Germany','A name derived only after the Roman period from the Latin word clarus or its feminine form clara, known by the name of St. Clare of Assisi, the founder of the Order of the Poor Clares','Ein erst nach der Zeit der Römer vom lateinischen Wort clarus bzw. dessen weiblicher Form clara abgeleiteter Name bekannt durch den Namen der hl. Klara von Assisi, der Gründerin des Klarissenordens','Një emër që rrjedh vetëm pas periudhës romake nga fjala latine clarus ose forma e saj femërore clara, e njohur me emrin e Shën Klarës së Asizit, themeluesit të Urdhrit të të varfërve Clares.'),
