            array('Konrada','1','Germany','Info about the male form Konrad: old German two-part name can be interpreted as a bold guide in the Middle Ages, one of the most popular first names in Germany, therefore used in the saying Hinz and Kunz ','Info zur männlichen Form Konrad: alter deutscher zweigliedriger Name kann interpretiert werden als kühner Ratgeber im Mittelalter einer der beliebtesten Vornamen in Deutschland darum verwendet in der Redensart Hinz und Kunz ','Informacion për formën mashkullore Konrad: emri i vjetër gjerman me dy pjesë mund të interpretohet si një udhërrëfyes i guximshëm në Mesjetë, një nga emrat më të njohur në Gjermani, prandaj përdoret në thënien Hinz dhe Kunz '),
