            array('Kora','1','Germany','Variant of Cora, which emerged in German as an independent short form of Cordula, Cordelia and Cornelia. In addition, Kora or Cora can also be the Latinized form of the Greek name Kore, an epithet of Persephone.','Variante von Cora, im Deutschen entstanden als verselbständigte Kurzform von Cordula, Cordelia und Cornelia. Zudem kann Kora bzw. Cora auch die latinisierte Form des griechischen Namens Kore sein, eines Beinamens der Persephone. ','Varianti i Cora, i cili u shfaq në gjermanisht si një formë e shkurtër e pavarur e Cordula, Cordelia dhe Cornelia. Përveç kësaj, Kora ose Cora mund të jetë gjithashtu forma e latinizuar e emrit grek Kore, një epitet i Persefonës.'),
