            array('Korbinian','0','Germany','Old German male first name, which is mainly known in Bavaria and Austria, probably derived from Latin corvus (=raven) in connection with an addition to the name Hraban (=raven\'), which was common in the Middle Ages, extended by the name ending -inianus, known by St. Korbinian, Bishop of Freising (7th 8th century) ','Alter deutscher männlicher Vorname, der vor allem in Bayern und Österreich bekannt ist wahrscheinlich abgeleitet von lateinisch corvus (=Rabe) in Verbindung mit einer Ergänzung des im Mittelalter häufigen Namend Hraban (=Rabe), erweitert um die Namensendung -inianusbekannt durch den hl. Korbinian, Bischof von Freising (7. 8. Jh.)','Emri i parë mashkullor gjerman i vjetër, i cili është i njohur kryesisht në Bavari dhe Austri, ndoshta rrjedh nga latinishtja corvus (=korb) në lidhje me një shtesë të emrit Hraban (=korb), i cili ishte i zakonshëm në Mesjetë, i zgjeruar nga shek. mbaresa e emrit -inianus, e njohur nga Shën Korbinian, peshkop i Freisingut (shek. VII VIII) '),
            array('Kordelia','1','Germany','German form of Cordelia; a variant of the originally Latin name Cordula','Deutsche Form von Cordelia; einer Variante des ursprünglich lateinischen Namens Cordula','Forma gjermane e Cordelia; një variant i emrit fillimisht latin Cordula'),
            array('Kordt','0','Germany','Independent short form of Konrad','Verselbständigte Kurzform von Konrad','Forma e shkurtër e pavarur e Konradit'),
            array('Kordula','1','Germany','First name with Latin origin, variant con Cordula; probably derived from Latin cordus (=late born, late developed\'), later interpreted in connection with cor, cordis (=heart) to heart; spread through the veneration of St. Cordula, martyr and Companion of St. Ursula ','Vorname mit lateinischem Ursprung, Variante con Cordula; wahrscheinlich abgeleitet von lat. cordus (=spät geboren, spät entwickelt), später in Verbindung cor, cordis (=Herz) zu Herzchen interpretiert; verbreitet durch die Verehrung der hl. Cordula, Märtyrerin und Begleiterin der hl. Ursula','Emri me origjinë latine, variant con Cordula; ndoshta rrjedh nga latinishtja cordus (=lindur vonë, i zhvilluar vonë), interpretuar më vonë në lidhje me cor, cordis (=zemër) në zemër; përhapur përmes nderimit të Shën Cordula, martir. dhe shoqëruese e Shën Ursulës'),
