            array('Kriemhild','1','Germany','Old High German female first name; known from Siegfrieds wife in the Nibelungen saga. The male form of Kriemhild is Hildegrim.','Althochochdeutscher weiblicher Vorname; bekannt durch die Frau Siegfrieds in der Nibelungen-Sage Die männliche Form von Kriemhild ist Hildegrim.','Emri i parë femëror i vjetër gjerman i lartë; i njohur nga gruaja e Siegfried në sagën Nibelungen. Forma mashkullore e Kriemhild është Hildegrim.'),
            array('Kriemhilde','1','Germany','Old High German female first name; variant of Kriemhild, commonly known as Siegfrieds wife in the Nibelungen saga. The male form of Krimhilde is Hildegrim.','Althochochdeutscher weiblicher Vorname; Variante von Kriemhild, allgemein bekannt die Frau Siegfrieds in der Nibelungen-Sage Die männliche Form von Krimhilde ist Hildegrim.','Emri i parë femëror i vjetër gjerman i lartë; variant i Kriemhild, i njohur zakonisht si gruaja e Siegfried në sagën Nibelungen. Forma mashkullore e Krimhilde është Hildegrim.'),
