            array('Krischan','0','Germany','Low German pet form of Kristian or Christian','Niederdeutsche Koseform von Kristian bzw. Christian','Forma e ulët gjermane e përkëdhelur e Kristian ose e Krishterë'),
            array('Krispin','0','Germany','Male first name with Latin origin, German variant of Crispin or Crispinus, a Roman nickname. Derived from Latin crispus (=curly-haired)','Männlicher Vorname mit lateinischer Herlkunft, deutsche Varinate von Crispin bzw. Crispinus, einem römischen Beinamen. abgeleitet von lat. crispus (=kraushaarig)','Emri i parë mashkullor me origjinë latine, variant gjerman i Crispin ose Crispinus, një pseudonim romak. Rrjedh nga latinishtja crispus (=me flokë kaçurrelë)'),
            array('Kristiane','1','Germany','Variant of Christiane','Variante von Christiane','Varianti i të krishterëve'),
            array('Kundry','1','Old-German','Cundrie or Kundry is a messenger of the Grail in the Arthurian legend and in Parzifal; in Germany the name became known through the character in Richard Wagners opera Parsifal','Cundrie bzw. Kundry ist in der Artussage bzw. in Parzifal eine Gralsbotin; in Deutschland wurde der Name bekannt durch die Figur in Richard Wagners Oper Parsifal','Cundrie ose Kundry është një lajmëtar i Graalit në legjendën Arthuriane dhe në Parzifal; në Gjermani emri u bë i njohur përmes personazhit në operën Parsifal të Richard Wagner'),
