            array('Kunibert','0','Germany','Old German two-part name; spread in the Middle Ages by the name of St. Cunibert, Bishop of Cologne in the 7th century','Alter deutscher zweigliedriger Name; im Mittelalter verbreitet durch den Namen des hl. Kunibert, Bischof von Köln im 7. Jh.','Emri i vjetër gjerman dypjesësh; i përhapur në mesjetë me emrin e Shën Cunibertit, peshkop i Këlnit në shekullin e VII.'),
            array('Kunigunde','1','Germany','Old, German, two-part name. Extremely popular in the Middle Ages. Spread, for example, through the veneration of St. Empress Kunigunde, the wife of Henry II (11th century). ','Alter, deutscher, zweigliedriger Name. Im Mittelalter überaus beliebt. Verbreitet z.B. durch die Verehrung der hl. Kaiserin Kunigunde, der Gemahlin Heinrichs II. (11. Jh.).','Emër i vjetër, gjerman, dypjesësh. Jashtëzakonisht i popullarizuar në Mesjetë. Përhapet, për shembull, nëpërmjet nderimit të Shën Perandoreshës Kunigunde, gruaja e Henry II (shek. 11). '),
            array('Kuniza','1','Germany','Old German two-part name, short form of Kunigunde; extremely popular in the Middle Ages. spread, for example, through the veneration of the Holy Empress Kunigunde, the wife of Henry II (11th century)','Alter deutscher zweigliedriger Name, Kurzform von Kunigunde; im Mittelalter überaus beliebt. verbreitet z.B. durch die Verehrung der hl. Kaiserin Kunigunde, der Gemahlin Heinrichs II. (11. Jh.)','Emri i vjetër gjerman me dy pjesë, formë e shkurtër e Kunigunde; jashtëzakonisht popullor në Mesjetë. u përhap, për shembull, nëpërmjet nderimit të Perandoreshës së Shenjtë Kunigunde, gruaja e Henry II (shekulli i 11-të)'),
            array('Kunz','0','Germany','Old German two-part name, short form of Konrad, can be interpreted as a bold advisor, one of the most popular first names in the Middle Ages, therefore used in Germany in the saying Hinz and Kunz ','Alter deutscher zweigliedriger Name, Kurzform von Konrad, kann interpretiert werden als hner Ratgeber, im Mittelalter einer der beliebtesten Vornamen, in Deutschland darum verwendet in der Redensart Hinz und Kunz','Emri i vjetër gjerman me dy pjesë, forma e shkurtër e Konrad, mund të interpretohet si një këshilltar i guximshëm, një nga emrat e parë më të njohur në Mesjetë, prandaj përdoret në Gjermani në thënien Hinz dhe Kunz'),
            array('Kurt Martin','0','Germany','Kurt: independent short form of Konrad Martin: goes back to the Roman nickname Martinus, which in turn goes back to the name of the war god Mars; spread by the name of St. Martin (4th century\'), who shared his cloak with a beggar; So far, 5 popes have had the name Martin or Martinus ','Kurt: verselbständigte Kurzform von KonradMartin: geht zurück auf den römischen Beinamen Martinus, der wiederum auf den Namen des Kriegsgottes Mars zurückgeht; verbreitet durch den Namen des hl. Martin (4. Jh.\'), der seinen Mantel mit einem Bettler teilte; bisher trugen 5 Päpste den Namen Martin bzw. Martinus','Kurt: formë e shkurtër e pavarur e Konrad Martinit: shkon prapa në pseudonimin romak Martinus, i cili nga ana e tij kthehet në emrin e perëndisë së luftës Mars; i përhapur me emrin e Shën Martinit (shek. IV\'), i cili ndante mantelin e tij me një lypës; Deri më tani, 5 papë kanë pasur emrin Martin ose Martinus '),
            array('Lacoste','0','Germany','Company name as first name; name was originally a surname (either from a French place name Coste or a name for someone who lived on the coast river bank)','Firmenname als Vorname; Name war ursprünglich ein Nachname (entweder von einem franz. Ortsnamen Coste oder eine Bezeichnung für jemand, der an der Küste Flussufer wohnte)','Emri i kompanisë si emër i parë; emri fillimisht ishte një mbiemër (qoftë nga një emër vendi francez Coste ose një emër për dikë që jetonte në breg të bregut   lumit)'),
            array('Ladislaja','1','Germany','Female formation of Ladislaus or variant of Ladislawa','Weibliche Bildung von Ladislaus bzw. Variante von Ladislawa','Formimi femëror i Ladislaus ose variant i Ladislawa'),
            array('Ladislaus','0','Germany','Old Slavic two-part name known by Ladislaus I, King of Hungary, who was canonized in 1192','Alter slawischer zweigliedriger Name bekannt durch Ladislaus I., König von Ungarn, der 1192 heilig gesprochen wurde','Emri dypjesësh sllav i vjetër i njohur nga Ladislaus I, Mbreti i Hungarisë, i cili u shpall shenjtë në vitin 1192'),
