            array('Lara Sophia','1','Germany','Lara could be the female form of Lorenz: The name goes back to the ancient Roman nickname Laurentius (= the one who comes from the city of Laurentium); later reinterpreted based on laurus as the laurel wreath - with a laurel wreath as a symbol of victory the victor. The The first name Sophia is of Greek origin and refers to virtue or divine wisdom; later various saints bore this name.','Lara könnte die weibliche Form von Lorenz sein: Der Name geht zurück auf den altrömischen Beinamen Laurentius der aus der Stadt Laurentium Stammende später in Anlehnung an laurus umgedeutet in der Lorbeerbekränzte - mit Lorbeerkranz als Symbol des Sieges des Siegers.Der Vorname Sophia ist griechischer Herkunft und bezeichnet die Tugend oder göttliche Weisheit, später trugen diverse Heilige diesen Namen.','Lara mund të jetë forma femërore e Lorenzit: Emri kthehet në pseudonimin e lashtë romak Laurentius (= ai që vjen nga qyteti i Laurentium); më vonë u riinterpretua bazuar në laurus si kurora e dafinës - me një kurorë dafine si simbol. i fitores fitimtarit. Emri i parë Sophia është me origjinë greke dhe i referohet virtytit ose mençurisë hyjnore; më vonë shenjtorë të ndryshëm mbajtën këtë emër.'),
