            array('Lea Marie','1','Germany','Leah: Meaning not known with certainty, either wild cow or tired; an Assyrian instead of Hebrew origin is also possible, with a different meaning; in the Bible, Leah becomes Jacobs first wife and the mother of six sons and daughter Dinah through a deception by her father . Marie: Variant of Mary; as the name of Jesus mother, a symbol of pure and deep love; meaning not clarified with certainty; one possibility: bitterness, another possibility is an Egyptian origin and a derivation of mry (the beloved, in the sense of: the one who is loved the one who is loved); Mary is the Greek Latin origin form, Miriam the older Aramaic Hebrew; probably the most widespread Christian female name ','Lea: Bedeutung nicht sicher bekannt, entweder Wildkuh oder müde; möglich ist auch eine assyrische statt hebräische Herkunft, mit wiederum anderer Bedeutung; in der Bibel wird Leah durch einen Betrug ihres Vaters die erste Frau Jakobs und die Mutter von sechs Söhnen und Tochter Dina. Marie: Variante von Maria; als Name der Mutter Jesu Symbol für reine und tiefe Liebe; Bedeutung nicht sicher geklärt; eine Möglichkeit: Verbitterung eine andere Möglichkeit ist ein ägyptischer Ursprung und eine Ableitung von mry (die der Geliebte, im Sinne von: die, welche geliebt wird der, welcher geliebt wird); Maria ist die griechische lateinische Ursprungs-Form, Mirjam die ältere aramäische hebräische; wohl der am weitesten verbreitete christliche weibliche Name ','Lea: Kuptimi nuk dihet me siguri, ose lopë e egër ose e lodhur; një asirian në vend të origjinës hebraike është gjithashtu i mundur, me një kuptim tjetër; në Bibël, Lea bëhet gruaja e parë e Jakobit dhe nëna e gjashtë djemve dhe vajzës Dinah nëpërmjet një mashtrim nga babai i saj Marie: Variant i Marisë; si emri i nënës së Jezusit, një simbol i dashurisë së pastër dhe të thellë; që do të thotë i paqartë me siguri; një mundësi: hidhërim, një mundësi tjetër është një origjinë egjiptiane dhe një prejardhje e mry ( e dashura, në kuptimin: ai që dashurohet ajo që dashurohet); Maria është forma e origjinës greke latinisht, Miriam më e vjetra aramaike hebraike; ndoshta emri femëror më i përhapur i krishterë '),
