            array('Lena Marie','1','Germany','Lena: Lena is considered a short form of either Helena Helene or Magdalena. In Greek mythology, Helena is the daughter of Zeus and Leda. In the Bible, Mary Magdalene was one of Jesus most faithful disciples. At the time of Jesus, Magdala was a lakeside town Galilee, whose name in turn goes back to a Hebrew Aramaic word for tower. Marie: Variant of Mary; as the name of the mother of Jesus, a symbol of pure and deep love; meaning not clarified with certainty. One possibility: bitterness, another possibility is an Egyptian origin and a derivation from mry (the beloved, in the sense of: the one who is loved the one who is loved). Mary is the Greek Latin original form, Miriam the older Aramaic Hebrew and probably the most widespread Christian female name.','Lena: Lena wird entweder als Kurzform von Helena Helene oder Magdalena angesehen. In der griechischen Mythologie ist Helena die Tochter von Zeus und Leda. Maria Magdalena war in der Bibel eine der treuesten Jüngerinnen Jesu. Zur Zeit Jesu war Magdala eine Stadt am See Genezareth, deren Name wiederum auf ein hebräisch aramäisches Wort für Turm zurückgeht. Marie: Variante von Maria; als Name der Mutter Jesu Symbol für reine und tiefe Liebe; Bedeutung nicht sicher geklärt. Eine Möglichkeit: Verbitterung, eine andere Möglichkeit ist ein ägyptischer Ursprung und eine Ableitung von mry (die der Geliebte, im Sinne von: die, welche geliebt wird der, welcher geliebt wird). Maria ist die griechische lateinische Ursprungs-Form, Mirjam die ältere aramäische hebräische und der wohl am weitesten verbreitete christliche weibliche Name. ','Lena: Lena konsiderohet një formë e shkurtër e Helena Helenës ose Magdalenës. Në mitologjinë greke, Helena është e bija e Zeusit dhe Ledës. Në Bibël, Maria Magdalena ishte një nga dishepujt më besnikë të Jezusit. Në kohën e Jezusit , Magdala ishte një qytet buzë liqenit Galilea, emri i të cilit nga ana e tij shkon prapa në një fjalë hebraike arameike për kullë. Marie: Variant i Marisë; si emri i nënës së Jezusit, një simbol i dashurisë së pastër dhe të thellë; që do të thotë e paqartë me siguri Një mundësi: hidhërim, një mundësi tjetër është origjina egjiptiane dhe prejardhje nga mry (i dashur, në kuptimin: ai që është i dashur   ai që është i dashur) Maria është forma origjinale greke   latine, Miriam emri më i vjetër aramaik hebraik dhe ndoshta emri femëror më i përhapur i krishterë.'),
