            array('Leoni','1','Germany','Female form of Leon Leo; goes back to a late Roman nickname; also used as a short form of Leonhard and Leopold; so far 13 popes have had the name Leo ','Weibl. Form von Leon Leo; geht zurück auf einen spätrömischen Beinamen; auch als Kurzform von Leonhard und Leopold in Gebrauch; bisher trugen 13 Päpste den Namen Leo','Forma femërore e Leon Leo; shkon prapa në një pseudonim të vonë romak; përdoret gjithashtu si një formë e shkurtër e Leonhard dhe Leopold; deri më tani 13 papë e kanë pasur emrin Leo '),
            array('Leonie','1','Germany','Female form of Leon Leo. Goes back to a late Roman nickname. Also known as a short form of Eleonore. Information about the male form: Also used as a short form of Leonhard and Leopold. So far, 13 popes have had the name Leo.','Weibl. Form von Leon Leo. Geht zurück auf einen spätrömischen Beinamen. Auch als Kurzform von Eleonore bekannt. Information zur männlichen Form: Auch als Kurzform von Leonhard und Leopold in Gebrauch. Bisher trugen 13 Päpste den Namen Leo.','Forma femërore e Leon Leo. Kthehet në një pseudonim të vonë romak. I njohur gjithashtu si një formë e shkurtër e Eleonore. Informacion rreth formës mashkullore: Përdoret gjithashtu si një formë e shkurtër e Leonhard dhe Leopold. Deri më tani, 13 papë kanë pasur emri Leo.'),
            array('Leonit','0','Germany','Variant of Leonid','Variante von Leonid','Varianti i Leonidit'),
            array('Leonore','1','Germany','Short form of Eleonore; from an old Provençal name Alienor; Alienor was interpreted as a variant of Helen; but the name is probably of Germanic origin, a formation with the name element Ali ','Kurzform von Eleonore; von einem alten provenzalischen Namen Alienor; Alienor wurde gedeutet als eine Variante von Helen; der Name ist aber wahrscheinlich germanischer Herkunft, eine Bildung mit dem Namenselement Ali','Forma e shkurtër e Eleonore; nga një emër i vjetër provansal Alienor; Alienor u interpretua si një variant i Helenit; por emri ndoshta është me origjinë gjermanike, një formacion me elementin e emrit Ali '),
