            array('Leontine','1','Germany','Female form of the Latin name Leontinus, a further development of Leontius','Weibliche Form des lateinischen Namens Leontinus, einer Weiterbildung von Leontius','Forma femërore e emrit latin Leontinus, një zhvillim i mëtejshëm i Leontius'),
            array('Leony','1','Germany','Leony is a variant of Leonie, the female form of Leon and therefore refers to the lion. Leonie is also known as the short form of Eleonore. The name Leonie first appeared in the first name charts in Germany in the early 1980s. From 2001 to 2010 Leonie was always among the ten most frequently given first names for female infants in Germany.','Leony ist eine Variante von Leonie, der weiblichen Form von Leon und bezieht sich daher auf den Löwen. Leonie ist auch als Kurzform von Eleonore bekannt. Der Name Leonie tauchte in Deutschland Anfang der 1980er Jahre erstmals in den Vornamenhitparaden auf. Von 2001 bis 2010 war Leonie stets bei den zehn am häufigsten vergebenen Vornamen für weibliche Säuglinge in Deutschland.','Leoni është një variant i Leonie, forma femërore e Leon dhe për këtë arsye i referohet luanit. Leonie njihet gjithashtu si forma e shkurtër e Eleonore. Emri Leonie u shfaq për herë të parë në listat e emrave të parë në Gjermani në fillim të viteve 1980. Nga 2001 deri në vitin 2010, Leonie ishte gjithmonë në mesin e dhjetë emrave më të shpeshtë të dhënë për foshnjat femra në Gjermani.'),
