            array('Levantin','0','Germany','Levant is the name for the countries east of the Mediterranean; the translation is synonymous with Orient; Levantine refers to the inhabitants of the regions between southern Turkey and Sinai','Levante ist die Bezeichnung für die Länder östlich des Mittelmeers; die Übersetzung ist gleichbedeutend mit Morgenland; mit Levantiner werden die Bewohner der Regionen zwischen südlicher Türkei und dem Sinai bezeichnet','Levant është emri për vendet në lindje të Mesdheut; përkthimi është sinonim i Orientit; Levantine i referohet banorëve të rajoneve midis Turqisë jugore dhe Sinait.'),
