            array('Lisa Marie','1','Germany','Lisa: short form of Elisabeth; the meaning of the name is not exactly known. 2 interpretations are common, depending on the interpretation of the 2nd name element as derived from sheba (seven) or from saba (oath): My God is seven with seven as that Symbol for abundance, so My God is abundance or: My God has sworn; in the Bible, Elisabeth is the mother of John the Baptist Marie: as the name of the mother of Jesus Symbol for pure and deep love Meaning not clarified with certainty; one possibility: bitterness another Possibility is an Egyptian origin and a derivation of mry (the beloved, in the sense of: the one who is loved the one who is loved). Mary is the Greek Latin original form, Miriam the older Aramaic Hebrew probably the most widespread Christian female name ','Lisa: Kurzform von Elisabeth; die Bedeutung des Namens ist nicht genau bekannt 2 Deutungen sind verbreitet, je nach Interpretation des 2. Namenselements als abgeleitet von scheba (sieben) oder von saba (Schwur): Mein Gott ist Sieben mit der Sieben als dem Sinnbild für Fülle, also Mein Gott ist Fülle oder: Mein Gott hat geschworen; in der Bibel ist Elisabeth die Mutter Johannes des Täufers Marie: als Name der Mutter Jesu Symbol für reine und tiefe Liebe Bedeutung nicht sicher geklärt; eine Möglichkeit: Verbitterung eine andere Möglichkeit ist ein ägyptischer Ursprung und eine Ableitung von mry (die der Geliebte, im Sinne von: die, welche geliebt wird der, welcher geliebt wird) Maria ist die griechische lateinische Ursprungs-Form, Mirjam die ältere aramäische hebräische wohl der am weitesten verbreitete christliche weibliche Name ','Lisa: forma e shkurtër e Elisabeth; kuptimi i emrit nuk dihet saktësisht. 2 interpretime janë të zakonshme, në varësi të interpretimit të elementit të dytë të emrit si rrjedh nga sheba (shtatë) ose nga saba (betimi): Zoti im është shtatë me shtatë si ai Simbol për bollëk, pra Zoti im është me bollëk ose: Zoti im është betuar; në Bibël, Elizabeta është nëna e Gjon Pagëzorit Mari: si emri i nënës së Jezusit Simbol për dashurinë e pastër dhe të thellë Nuk do të thotë sqaruar me siguri; një mundësi: hidhërim një tjetër Mundësia është një origjinë egjiptiane dhe një prejardhje e mry (i dashur, në kuptimin: ai që është i dashur   ai që është i dashur). Mary është forma origjinale greke latinisht, Miriam, aramaishtja hebraishtja më e vjetër, ndoshta emri femëror më i përhapur i krishterë '),
