            array('Lisbeth','1','Germany','The meaning of the name is not exactly known, two interpretations are common, depending on the interpretation of the second element of the name as derived from sheba (seven) or from saba (oath): My God is seven with the seven as the symbol of abundance, so My God is abundance or: My God swore in the Bible is Elizabeth the mother of John the Baptist ','Die Bedeutung des Namens ist nicht genau bekannt, zwei Deutungen sind verbreitet, je nach Interpretation des 2. Namenselements als abgeleitet von scheba (sieben) oder von saba (Schwur): Mein Gott ist Sieben mit der Sieben als dem Sinnbild für Fülle, also Mein Gott ist Fülle oder: Mein Gott hat geschworen in der Bibel ist Elisabeth die Mutter Johannes des Täufers ','Kuptimi i emrit nuk dihet saktësisht, dy interpretime janë të zakonshme, në varësi të interpretimit të elementit të dytë të emrit si rrjedh nga sheba (shtatë) ose nga saba (betimi): Zoti im është shtatë me shtatë si simbol i bollëkut, pra Perëndia im është bollëk ose: Perëndia im u betua në Bibël është Elizabeta nëna e Gjon Pagëzorit'),
