            array('Loreley','1','Germany','Originally, Loreley is the name of a slate rock that rises out of the Rhine shortly before St.Goarshausen; in 1801, the poet Clemens Brentano created the fantasy figure Lore Lay, a water woman sitting on the rock who lures sailors to their death with her song. The meaning of the name is not entirely clear, maybe ambus rocks ','Ursprünglich ist Loreley der Name eines Schieferfelsens, der kurz vor St.Goarshausen aus dem Rhein ragt; der Dichter Clemens Brentano erschuf 1801 die Phantasiegestalt Lore Lay, eine auf dem Felsen sitzende Wasserfrau, die mit Gesang Seefahrer in den Tod locktdie Bedeutung des Namens ist nicht ganz klar, vielleicht Hinterhalt Felsen','Fillimisht, Loreley është emri i një shkëmbi me rrasa që ngrihet nga Rhine pak para St. me këngën e saj. Kuptimi i emrit nuk është plotësisht i qartë, ndoshta prit shkëmbinj '),
