            array('Lorenz','0','Germany','Goes back to the ancient Roman nickname Laurentius: the man who came from the city of Laurentium. Later reinterpreted based on laurus in the laurel wreath as a symbol of victory the victor.','Geht zurück auf den altrömischen Beinamen Laurentius: der aus der Stadt Laurentium Stammende. Später in Anlehnung an laurus umgedeutet in der Lorbeerbekränzte mit Lorbeerkranz als Symbol des Sieges des Siegers.','Kthehet në nofkën e lashtë romake Laurentius: njeriu i ardhur nga qyteti i Laurentium. Më vonë riinterpretuar bazuar në laurus në kurorë dafine si simbol i fitores fitimtarit.'),
