            array('Lovis','2','Germany','Lovis is the Low German variant of Louis Ludwig; old German two-part name; widespread throughout Europe as the name of German and French kings and emperors. Lovis is originally known in Germany as a male first name. In Scandinavia - and especially in Sweden - it is However, the name is also used as a female first name. The name also gained greater fame in Germany through Astrid Lindgrens novel Ronja, the Robbers Daughter.','Lovis ist die niederdt. Variante von Louis Ludwig; alter deutscher zweigliedriger Name; als Name deutscher und französischer Könige und Kaiser in ganz Europa verbreitet. Lovis ist in Deutschland ursprünglich als männlicher Vorname bekannt. In Skandinavien - und insbesondere in Schweden - ist der Name allerdings auch als weiblicher Vorname gebräuchlich. Größere Bekanntheit erlangte der Name auch in Deutschland durch Astrid Lindgrens Roman Ronja Räubertochter.','Lovis është varianti gjerman i ulët i Louis Ludwig; emri i vjetër gjerman me dy pjesë; i përhapur në të gjithë Evropën si emri i mbretërve dhe perandorëve gjermanë dhe francezë. Lovis fillimisht njihet në Gjermani si emri i parë mashkullor. Në Skandinavi - dhe veçanërisht në Suedi - është Megjithatë, emri përdoret edhe si emër i parë femëror. Emri gjithashtu fitoi famë më të madhe në Gjermani përmes romanit të Astrid Lindgren Ronja, vajza e grabitës.'),
