            array('Lutwin','0','Germany','The first name Lutwin comes from the Trier bishop Liutwin 17 in Reims, whose relics are kept in a sarcophagus in the parish church of St. Lutwinus in Mettlach Saarland, as he founded a monastery there in 690.','Der Vorname Lutwin stammt vom Trierer Bischof Liutwin 17 in Reims dessen Reliquien in einem Sarkophag in der Pfarrkirche St. Lutwinus in Mettlach Saarland aufbewahrt werden, da er dort 690 ein Kloster gegründet hatte.','Emri i parë Lutwin vjen nga peshkopi i Trierit Liutwin 17 në Reims reliket e të cilit mbahen në një sarkofag në kishën famullitare të Shën Lutwinus në Mettlach Saarland, pasi ai themeloi një manastir atje në vitin 690.'),
