            array('Majah','1','Germany','Majah is a variant of the first name Maja. Maja is a figure from Roman mythology. The name is derived from the Latin adjective maius (=greater) and means the higher, the greater. Maja can also be a pet form of the first name Maria.','Majah ist eine Variante des Vornamens Maja. Maja ist eine Figur aus der Römischen Mythologie. Der Name ist von dem lateinischen Adjektiv maius (=größer) abgeleitet und bedeutet die Höhere, die Größere. Maja kann auch eine Koseform des Vornamens Maria sein.','Majah është një variant i emrit të parë Maja. Maja është një figurë nga mitologjia romake. Emri rrjedh nga mbiemri latin maius (=më i madh) dhe do të thotë sa më i lartë, aq më i madh. Maja mund të jetë edhe një formë e përkëdhelur e së parës. emri Maria.'),
            array('Maje','1','Germany','Frisian form of Maria','Friesische Form von Maria','Forma Friziane e Maria'),
            array('Majolie','1','Germany','There is a painting by Picasso called Majolie, named after his lover at the time, who was called Ma Jolie (my beauty); there was also a song of the same name at the time','Es gibt ein Bild von Picasso namens Majolie, das nach seiner damaligen Geliebten benannt ist, die Ma Jolie (meine Schöne) genannt wurde; auch ein Lied desselben Namens gab es zu der Zeit','Ekziston një pikturë e Pikasos me emrin Majolie, që mban emrin e të dashurit të tij në atë kohë, i cili quhej Ma Jolie (bukuroshja ime); kishte edhe një këngë me të njëjtin emër në atë koh'),
            array('Majulie','1','Germany','Possibly a derivation from the name of the island Majuli Majoli, which lies in the middle of the Brahmaputra (river in India) The \\J\\ is, in my opinion, pronounced as SCH','Möglicherweise eine Ableitung vom Namen der Insel Majuli Majoli, die inmitten des Brahmaputra liegt (Fluss in Indien) Das wird meines erachtens als sch ausgesprochen','Ndoshta një prejardhje nga emri i ishullit Majuli Majoli, i cili shtrihet në mes të Brahmaputra (lumit në Indi) \\J\\ për mendimin tim, shqiptohet si SCH'),
            array('Maleen','1','Germany','Short form of Magdalena; nickname for Mary Magdalene, in the Bible one of Jesus most faithful disciples; at the time of Jesus, Magdala was a city on the Sea of Galilee, whose name in turn goes back to a Hebrew Aramaic word for tower ','Kurzform von Magdalena; Beiname von Maria Magdalena, in der Bibel eine der treuesten Jüngerinnen Jesu; zur Zeit Jesu war Magdala eine Stadt am See Genezareth, deren Name wiederum auf ein hebräisch aramäisches Wort für Turm zurückgeht','Forma e shkurtër e Magdalenës; pseudonimi për Maria Magdalena, në Bibël një nga dishepujt më besnikë të Jezusit; në kohën e Jezusit, Magdala ishte një qytet në detin e Galilesë, emri i të cilit nga ana e tij shkon prapa në një hebraik  Fjala aramaike për kullë '),
            array('Malick','0','Germany','Variant Germanization of Malik','Variante Eindeutschung von Malik','Varianti Gjermanizimi i Malik'),
            array('Malie','1','Germany','In the spelling Mali also a short form of Amalie; in the spelling Mallie also a Scottish variant of the Welsh name Mailli (goes back to Maria)','In der Schreibweise Mali auch eine Kurzform von Amalie; in der Schreibweise Mallie auch eine schottische Variante des walischen Namens Mailli (geht zurück auf Maria)','Në drejtshkrim Mali gjithashtu një formë e shkurtër e Amalie; në drejtshkrim Mallie gjithashtu një variant skocez i emrit uellsian Mailli (kthehet në Maria)'),
            array('Malinde','1','Germany','Extension of Malin, the Nordic form of Magdalena','Erweiterung von Malin, der nordischen Form von Magdalena','Zgjerimi i Malin, forma nordike e Magdalenës'),
