            array('Malisa','1','Germany','Several derivations possible: 1. Variant of Melissa; 2. Further development of Mali Meli (Amelie); 3. Composition of Marie and Lisa','Mehrere Herleitungen möglich: 1. Variante von Melissa; 2. Weiterbildung von Mali Meli (Amelie); 3. Zusammensetzung aus Marie und Lisa','Disa derivacione të mundshme: 1. Varianti i Melisës; 2. Zhvillimi i mëtejshëm i Mali Meli (Amelie); 3. Përbërja e Marie dhe Lisa'),
            array('Malkolm','0','Germany','Germanized and Scandinavian form of Malcolm; from a Scottish first name Mael Coluim meaning disciple of (St.) Columba; known as the name of several Scottish kings and as the name of a character in the Shakespeare play Macbeth ','Eingedeutschte und skandinavische Form von Malcolm; von einem schottischen Vornamen Mael Coluim mit der Bedeutung Jünger des (hl.) Columba; bekannt als Name mehrerer schottischer Könige und als Name einer Figur im Shakespeare-Drama Macbeth','Forma e gjermanizuar dhe skandinave e Malcolm; nga një emër i parë skocez Mael Coluim që do të thotë dishepull i (Shën) Columba; i njohur si emri i disa mbretërve skocezë dhe si emri i një personazhi në shfaqjen e Shekspirit Makbeth'),
            array('Malouna','1','Germany','New creation from Malou (double form from Marie and Louise) and Louna Luna','Neuschöpfung aus Malou (Doppelform aus Marie und Louise) und Louna Luna','Krijimi i ri nga Malou (formë e dyfishtë nga Marie dhe Louise) dhe Louna Luna'),
            array('Malte','0','Germany','Probably a short form of the Old High German (no longer in use) name Helmolt; known from Rilkes novel The Notes of Malte Laurids Brigge (1910)','Wahrscheinlich Kurzform des althochdeutschen (nicht mehr gebräuchlichen) Namens Helmolt; bekannt durch Rilkes Roman Die Aufzeichnungen des Malte Laurids Brigge (1910)','Ndoshta një formë e shkurtër e emrit të gjermanishtes së lartë të vjetër (nuk përdoret më) Helmolt; e njohur nga romani i Rilke Shënimet e Malte Laurids Brigge (1910)'),
            array('Malu','1','Germany','Hawaiian female first name also possible in Germany as a short form of Marie-Louise, in Spain from Maria Lucia','Hawaiianischer weiblicher Vornamein Deutschland auch als Kurzform von Marie-Louise möglich, in Spanien von Maria Lucia','Emri i parë femëror Hawaiian është gjithashtu i mundur në Gjermani si një formë e shkurtër e Marie-Louise, në Spanjë nga Maria Lucia'),
            array('Maluni','1','Germany','Unknown','Unbekannt','e panjohur'),
            array('Malve','1','Germany','Use of the name of the plant as a first name the name of the plant is very old, e.g. Latin malva ','Gebrauch des Namens der Pflanze als Vorname der Name der Pflanze ist sehr alt, z.B. lateinisch malva','Përdorimi i emrit të bimës si emër i parë emri i bimës është shumë i vjetër, p.sh. latinisht malva'),
            array('Malwin','0','Germany','It can be either a Germanization of the English name Melvin (with a different meaning, see there) or a variant of the old German name Madalwin; also used in the spelling Malvin','Es kann sich sowohl um eine Eindeutschung des englischen Namens Melvin handeln (mit anderer Bedeutung, siehe dort) als auch um eine Variante des alten deutschen Namens Madalwin; auch in der Schreibweise Malvin gebräuchlich ','Mund të jetë ose një gjermanizim i emrit anglez Melvin (me një kuptim tjetër, shih atje) ose një variant i emrit të vjetër gjerman Madalwin; i përdorur gjithashtu në drejtshkrimin Malvin.'),
            array('Malwine','1','Germany','Invented in the 18th century by James Mcpherson for his Ossian poetry the name was perhaps meant to mean smooth eyebrow in Gaelic Scottish','Im 18. Jh. von James Mcpherson für seine Ossian-Dichtung erfunden der Name sollte vielleicht glatte Augenbraue in Gälisch Schottisch bedeuten','I shpikur në shekullin e 18-të nga James Mcpherson për poezinë e tij osiane, emri mbase kishte për qëllim të nënkuptonte vetull të lëmuar në gjuhën galike skoceze'),
            array('Maly','1','Germany','Variant of Mali; independent short form of names that were formed with Amal- (e.g. Amalberga, Amalgund); the name component Amal- is characteristic of the names of the Ostrogothic royal family of the Amaler or Amelungen ','Variante von Mali; verselbständigte Kurzform von Namen, die mit Amal- gebildet wurden (z.B. Amalberga, Amalgund); der Namenbestandteil Amal- ist kennzeichnend für die Namen des ostgotischen Königsgeschlechts der Amaler oder Amelungen','Variant i Malit; formë e shkurtër e pavarur e emrave që u formuan me Amal- (p.sh. Amalberga, Amalgund); përbërësi i emrit Amal- është karakteristik për emrat e familjes mbretërore ostrogotike të Amaler ose Amelungen '),
            array('Mamertus','0','Germany','Name of a French bishop saint; St. Mamerz is considered an ice saint in northern Germany, the Netherlands and Switzerland','Name eines franz. Bischofs Heiligen; St. Mamerz gilt in Norddeutschland, den Niederlanden und der Schweiz als Eisheiliger','Emri i një peshkopi shenjtori francez; Shën Mamerz konsiderohet një shenjt akulli në Gjermaninë veriore, Holandë dhe Zvicër'),
            array('Mamke','1','Germany','little mother','Mütterchen','Nëna e vogël'),
