            array('Mandala','1','Germany','Unknown','Unbekannt','e panjohur'),
            array('Mandalena','1','Germany','German new creation from the Indian name Mandala and the German names Magdalena or Helena','Deutsche Neuschöpfung aus dem indischen Namen Mandala und den deutschen Namen Magdalena oder Helena','Krijimi i ri gjerman nga emri indian Mandala dhe emrat gjermanë Magdalena ose Helena'),
            array('Mandella','1','Germany','In the USA, Mandella is used as a female first name; the meaning is unclear; Mandella was originally a war shield of North American Indian tribes, but for the Hopi Indians it also has the meaning of luck and prosperity; Mandella is also used as a female first name in Spain and Italy, but with the meaning almond','In den USA wird Mandella als weiblicher Vorname genutzt; die Bedeutung ist unklar; ursprünglich war Mandella ein Kriegsschild nordamerikanischer Indianerstämme, hat bei den Hopi-Indianern auch die Bedeutung von Glück und Wohlstand;auch in Spanien und Italien wird Mandella als weiblicher Vorname genutzt, allerdings mit der Bedeutung Mandel','Në SHBA, Mandella përdoret si emër i parë femëror; kuptimi është i paqartë; Mandella fillimisht ishte një mburojë lufte e fiseve indiane të Amerikës së Veriut, por për indianët Hopi ka gjithashtu kuptimin e fatit dhe prosperitetit; Mandella përdoret gjithashtu. si emër femëror në Spanjë dhe Itali, por me kuptimin bajame'),
