            array('Manusch','1','Germany','Manousches (in German: Manusch) is the French name for a subgroup of the Sinti','Manousches (eingedeutscht: Manusch) ist die franz. Beszeichnung für eine Untergruppe der Sinti','Manousches (në gjermanisht: Manusch) është emri francez i një nëngrupi të Sinti-ve'),
