            array('Marbot','0','Germany','horse messenger','Pferdebote','lajmëtar i kalit'),
            array('Marc','0','Germany','Ancient Roman first name. The name was traditionally given primarily to those born in March, and was popular in the Middle Ages through the name of the evangelist Mark.','Alter, römischer Vorname. Der Name wurde traditionell vor allem den im März Geborenen gegeben im Mittelalter verbreitet durch den Namen des Evangelisten Markus.','Emri i parë romak i lashtë. Emri tradicionalisht u jepej kryesisht atyre që lindnin në mars dhe ishte i njohur në Mesjetë përmes emrit të ungjilltarit Mark.'),
            array('Marc Antonio','0','Germany','Marc: old Roman first name the name was traditionally given primarily to those born in March, spread in the Middle Ages by the name of the evangelist Markus Antonio: originally a Roman surname, probably of Etruscan origin, spread in Germany through the veneration of St. Anthony of Padua, the patron saint of Portugal (13th century)','Marc: alter römischer Vorname der Name wurde traditionell vor allem den im März Geborenen gegeben im Mittelalter verbreitet durch den Namen des Evangelisten MarkusAntonio: ursprünglich ein römischer Familienname, wahrscheinlich etruskischer Herkunft verbreitet in Deutschland durch die Verehrung des heiligen Antonius von Padua, dem Schutzpatron von Portugal (13. Jh.)','Marc: emri i parë romak i vjetër emri tradicionalisht iu dha kryesisht atyre që lindën në mars, i përhapur në mesjetë me emrin e ungjilltarit Markus Antonio: fillimisht një mbiemër romak, ndoshta me origjinë etruske, i përhapur në Gjermani përmes nderimit të Shën Antoni i Padovës, shenjt mbrojtës i Portugalisë (shek. 13)'),
            array('Marcell','0','Germany','From Marcellus, a further development or diminutive form of Marcus. Name of several saints and popes, e.g. St. Pope Marcellus (3rd 4th century). Marcel is a very popular fashion name today','Von Marcellus, einer Weiterbildung bzw. Verkleinerungsform von Marcus Name mehrerer Heiliger und Päpste, z.B. dem hl. Papst Marcellus (3. 4. Jh.) Marcel ist heute ein sehr beliebter Modename','Nga Marcellus, një zhvillim i mëtejshëm ose një formë zvogëluese e Marcus. Emri i disa shenjtorëve dhe papëve, p.sh. Shën Papa Marcellus (shek. III IV). Marcel është një emër shumë popullor i modës sot.'),
            array('Marcellina','1','Germany','Info about the male form Marcellinus: from the Roman surname Marcellinus, which is derived from the first name Marcellus, known by St. Marcellinus, Pope (4th century) as Marcellino in Italy, still in use today','Info zur männlichen Form Marcellinus: von römischen Familiennamen Marcellinus, welcher sich vom Vornamen Marcellus ableitet bekannt durch den hl. Marcellinus, Papst (4. Jh.) als Marcellino in Italien bis heute in Gebrauch','Informacion rreth formës mashkullore Marcellinus: nga mbiemri romak Marcellinus, i cili rrjedh nga emri i parë Marcellus, i njohur nga Shën Marcellinus, Papa (shek. IV) si Marcellino në Itali, ende në përdorim sot.'),
            array('Marcellinus','0','Germany','From the Roman surname Marcellinus, which is derived from the first name Marcellus, known by St. Marcellinus, Pope (4th century) as Marcellino in Italy, still in use today','Von römischen Familiennamen Marcellinus, welcher sich vom Vornamen Marcellus ableitet bekannt durch den hl. Marcellinus, Papst (4. Jh.) als Marcellino in Italien bis heute in Gebrauch','Nga mbiemri romak Marcellinus, i cili rrjedh nga emri i parë Marcellus, i njohur nga Shën Marcellinus, Papa (shek. IV) si Marcellino në Itali, ende në përdorim sot.'),
            array('Marces','0','Germany','Germanized, phonetic-like spelling of the English pronunciation of Marcus','Eingedeutschte, phonetisch-ähnliche Schreibweise der englischen Aussprache von Marcus','Drejtshkrim i gjermanizuar, fonetik i shqiptimit anglez të Marcus'),
            array('Marcus','0','Germany','Old Roman first name the name; was traditionally given primarily to those born in March; widespread in the Middle Ages through the name of the evangelist Mark ','Alter römischer Vorname der Name; wurde traditionell vor allem den im März Geborenen gegeben; im Mittelalter verbreitet durch den Namen des Evangelisten Markus','Emri i parë romak i vjetër; u jepej tradicionalisht kryesisht atyre që lindnin në mars; u përhap gjerësisht në Mesjetë përmes emrit të ungjilltarit Mark '),
            array('Marcy','1','Germany','pet form of Marcia','Koseform von Marcia','forma e përkëdhelur e Marcia'),
