            array('Maria Clara','1','Germany','Maria: As the name of the mother of Jesus, a symbol of pure and deep love; meaning not clarified with certainty; one possibility: bitterness; another possibility is an Egyptian origin and a derivation of mry (the beloved, in the sense of: which is loved the one who is loved); Mary is the Greek Latin original form, Mirjam is the older Aramaic Hebrew; probably the most widespread Christian female name Clara: a name only after the Roman period from the Latin word clarus or whose name is derived from the female form clara; known from the name of St. Clare of Assisi, the founder of the Order of the Poor Clares','Maria: Als Name der Mutter Jesu Symbol für reine und tiefe Liebe; Bedeutung nicht sicher geklärt; eine Möglichkeit: Verbitterung; eine andere Möglichkeit ist ein ägyptischer Ursprung und eine Ableitung von mry (die der Geliebte, im Sinne von: die, welche geliebt wird der, welcher geliebt wird); Maria ist die griechische lateinische Ursprungs-Form, Mirjam die ältere aramäische hebräische; wohl der am weitesten verbreitete christliche weibliche Name Clara: ein erst nach der Zeit der Römer vom lateinischen Wort clarus bzw. dessen weiblicher Form clara abgeleiteter Name; bekannt durch den Namen der hl. Klara von Assisi, der Gründerin des Klarissenordens','Maria: Si emri i nënës së Jezusit, një simbol i dashurisë së pastër dhe të thellë; që do të thotë e paqartë me siguri; një mundësi: hidhërim; një mundësi tjetër është një origjinë egjiptiane dhe një prejardhje e mry (i dashur, në kuptimin e : e cila është e dashur ajo që është e dashur); Maria është forma origjinale greke latine, Mirjam është më e vjetra aramaike hebraike; ndoshta emri femëror i krishterë më i përhapur Clara: emër vetëm pas periudhës romake nga fjala latine clarus. ose emri i të cilit rrjedh nga forma femërore clara; e njohur nga emri i Shën Klarës së Asizit, themeluesit të Urdhrit të të varfërve Clares'),
            array('Maria Elisabeth','1','Germany','Maria: as the name of the mother of Jesus, a symbol of pure and deep love; meaning not clarified with certainty; one possibility: bitterness; another possibility is an Egyptian origin and a derivation of mry (the beloved, in the sense of: which is loved the one who is loved); Mary is the Greek Latin original form, Miriam the older Aramaic Hebrew; probably the most widespread Christian female name Elisabeth: the meaning of the name is not exactly known 2 interpretations are widespread, Depending on the interpretation of the 2nd name element as derived from sheba (seven) or from saba (oath): My God is seven with the seven as the symbol for abundance, so My God is abundance or: My God swore in the Bible is Elizabeth the mother of John the Baptist ','Maria: als Name der Mutter Jesu Symbol für reine und tiefe Liebe; Bedeutung nicht sicher geklärt; eine Möglichkeit: Verbitterung; eine andere Möglichkeit ist ein ägyptischer Ursprung und eine Ableitung von mry (die der Geliebte, im Sinne von: die, welche geliebt wird der, welcher geliebt wird); Maria ist die griechische lateinische Ursprungs-Form, Mirjam die ältere aramäische hebräische; wohl der am weitesten verbreitete christliche weibliche Name Elisabeth: die Bedeutung des Namens ist nicht genau bekannt 2 Deutungen sind verbreitet, je nach Interpretation des 2. Namenselements als abgeleitet von scheba (sieben) oder von saba (Schwur): Mein Gott ist Sieben mit der Sieben als dem Sinnbild für Fülle, also Mein Gott ist Fülle oder: Mein Gott hat geschworen in der Bibel ist Elisabeth die Mutter Johannes des Täufers ','Maria: si emri i nënës së Jezusit, simbol i dashurisë së pastër dhe të thellë; që do të thotë e paqartë me siguri; një mundësi: hidhërim; një mundësi tjetër është origjina egjiptiane dhe prejardhja e mry (e dashura, në kuptimin e : e cila është e dashur ajo që është e dashur); Maria është forma origjinale greke latine, Miriam më e vjetra aramaike hebraike; ndoshta emri femëror i krishterë më i përhapur Elisabeth: kuptimi i emrit nuk dihet saktësisht. 2 interpretime janë të përhapura , Në varësi të interpretimit të elementit të dytë të emrit si rrjedh nga sheba (shtatë) ose nga saba (betimi): Zoti im është shtatë me shtatë si simbol për bollëk, pra Zoti im është bollëk ose: Zoti im u betua në Bibël është Elizabeta nëna e Gjon Pagëzorit'),
