            array('Maron','1','Germany','Saint Maron, a Syrian monk, founded the Maronite religious community as a breakaway from the Syrian Orthodox Church','Der Heilige Maron, ein syrischer Mönch, gründete die Religionsgemeinschaft der Maroniten als Abspaltung der Syrisch-Orthodoxen Kirche ','Shën Maroni, një murg sirian, themeloi bashkësinë fetare maronite si një i shkëputur nga Kisha Ortodokse Siriane.'),
