            array('Martell','0','Germany','Originally a surname job title (see Karl Martell): originated either as a pet form of Martin or as a nickname for a blacksmith (English martel = the battle axe)','Ursprünglich ein Nachname Berufsbezeichnung (siehe Karl Martell): entstanden entweder durch eine Koseform von Martin oder als ein Spitzname für einen Schmied (engl. martel = die Streitaxt)','Fillimisht një mbiemër titull pune (shih Karl Martell): e ka origjinën ose si një formë shtëpiake e Martinit ose si pseudonim për një farkëtar (anglisht martel = sëpata e betejës)'),
            array('Martial','0','Germany','From a Roman epithet Martialis, derived from the name of the war god Mars known by the Roman poet Marcus Valerius Martialis (1st century)','Von einem römischen Beinamen Martialis, abgeleitet vom Namen des Kriegsgottes Mars bekannt durch den römischen Dichter Marcus Valerius Martialis (1. Jh.)','Nga një epitet romak Martialis, që rrjedh nga emri i perëndisë së luftës Mars i njohur nga poeti romak Marcus Valerius Martialis (shekulli I)'),
            array('Martje','1','Germany','Two derivations: from Martha or from Martin; in the Bible, Martha is the sister of Lazarus; Martin goes back to the Roman nickname Martinus, which in turn goes back to the name of the war god Mars','Zwei Herleitungen: von Martha oder von Martin; in der Bibel ist Martha die Schwester des Lazarus; Martin geht zurück auf den römischen Beinamen Martinus, der wiederum auf den Namen des Kriegsgottes Mars zurückgeht ','Dy prejardhje: nga Marta ose nga Martin; në Bibël, Marta është motra e Llazarit; Martin kthehet në pseudonimin romak Martinus, i cili nga ana e tij kthehet në emrin e perëndisë së luftës Mars.'),
            array('Martli','1','Germany','Possibly a pet form of the name Martina; cf. Martl as a pet form of Martin; information about the male form Martin: goes back to the Roman nickname Martinus, which in turn goes back to the name of the war god Mars; spread through the name of St. Martin ( 4th century), who shared his cloak with a beggar ','Möglicherweise eine Koseform von Namen wir Martina; vgl. Martl als Koseform von Martin;Info zur männlichen Form Martin: geht zurück auf den römischen Beinamen Martinus, der wiederum auf den Namen des Kriegsgottes Mars zurückgeht; verbreitet durch den Namen des hl. Martin (4. Jh.), der seinen Mantel mit einem Bettler teilte ','Ndoshta një formë përkëdhelëse e emrit Martina; shih Martl si një formë e përkëdhelur e Martinit; informacion për formën mashkullore Martin: shkon prapa në pseudonimin romak Martinus, i cili nga ana e tij kthehet në emrin e perëndisë së luftës Mars; përhapur përmes emrit të Shën Martinit (shek. IV), i cili ndante mantelin e tij me një lypës '),
            array('Marulf','0','Germany','Great, powerful ruler','Großer, mächtiger Herrscher','Sundimtar i madh, i fuqishëm'),
            array('Marven','0','Germany','Originally an English surname, seen as a variant of Marvin; the originally Welsh name Merfyn was long used as a family name in England; a Welsh king in the 9th century was called Merfyn; the meaning of the name is not known with certainty, possibly. from mer = Mark','Ursprünglich ein englischer Nachname, der als Variante von Marvin gesehen wird;der ursprünglich walisische Name Merfyn war in England lange als Familienname im Gebrauch; ein walisischer König im 9. Jh. hieß Merfyn; die Bedeutung des Namens ist nicht sicher bekannt, evtl. von mer = Mark','Fillimisht një mbiemër anglez, i parë si një variant i Marvin; emri fillimisht uellsian Merfyn u përdor prej kohësh si emër familjar në Angli; një mbret i Uellsit në shekullin e 9-të quhej Merfyn; kuptimi i emrit nuk dihet me siguri, ndoshta. nga mer = Mark'),
            array('Marx','0','Germany','Short version of Marcus, an ancient Roman first name traditionally given primarily to those born in March; Marx is also common as a surname','Kurzversion von Marcus, einem alten römischer Vorname, der traditionell vor allem den im März Geborenen gegeben wurde; Marx ist auch als Nachname verbreitet','Versioni i shkurtër i Marcus, një emër i parë romak i lashtë që tradicionalisht u jepet kryesisht atyre që kanë lindur në mars; Marksi është gjithashtu i zakonshëm si mbiemër.'),
