            array('Merle Tabea','1','Germany','Merle: The first name Merle is derived from the Irish name Muriel or the surname Merrill, both of which are another form of Muirgel and mean bright or shining sea. The name was influenced in spelling and interpretation by the French word merle, which Blackbird means. Since the 1980s, Merle has enjoyed growing and lasting popularity in Germany. Merle also serves as a short form for the first name Merlinde. Tabea: Short form; in the Bible, Tabitha is a Christian who is raised from death by Peter; spellings and name variants with h in front (Thabita, Thabea) are, strictly speaking, wrong','Merle: Der Vorname Merle leitet sich vom irischen Namen Muriel oder dem Nachnamen Merrill ab, die beide wiederum eine andere Form von Muirgel sind und helles oder strahlendes Meer bedeuten. Der Name wurde in der Schreibweise und Deutung durch das französische Wort merle beeinflusst, das Amsel bedeutet. Seit den 1980ern erfreut sich Merle in Deutschland wachsender und anhaltender Beliebtheit. Merle dient auch als Kurzform für den Vornamen Merlinde. Tabea: Kurzform; in der Bibel ist Tabitha eine Christin, die durch Petrus vom Tode erweckt wird; Schreibungen und Namensvarianten mit h vorne (Thabita, Thabea) sind streng genommen falsch','Merle: Emri i parë Merle rrjedh nga emri irlandez Muriel ose mbiemri Merrill, që të dyja janë një formë tjetër e Muirgel dhe do të thotë det i ndritshëm ose i ndritshëm. Emri u ndikua në drejtshkrim dhe interpretim nga fjala franceze merle, e cila Blackbird Që nga vitet 1980, Merle ka pasur një popullaritet në rritje dhe të qëndrueshme në Gjermani. Merle shërben gjithashtu si një formë e shkurtër për emrin e parë Merlinde. Tabea: Forma e shkurtër; në Bibël, Tabitha është një e krishterë që është ringjallur nga vdekja nga Pjetri; drejtshkrimet dhe variantet e emrave me h përpara (Thabita, Thabea) janë, në mënyrë rigoroze, të gabuara'),
