            array('Mimmi','1','Germany','As the name of the mother of Jesus, a symbol of pure and deep love, the meaning has not been clarified with certainty; one possibility: bitterness, another possibility is an Egyptian origin and a derivation of mry (the beloved, in the sense of: the one who is loved). , which is loved) Mary is the Greek Latin origin form, Miriam the older Aramaic Hebrew is probably the most widespread Christian female name ','Als Name der Mutter Jesu Symbol für reine und tiefe Liebe Bedeutung nicht sicher geklärt; eine Möglichkeit: Verbitterung eine andere Möglichkeit ist ein ägyptischer Ursprung und eine Ableitung von mry (die der Geliebte, im Sinne von: die, welche geliebt wird der, welcher geliebt wird) Maria ist die griechische lateinische Ursprungs-Form, Mirjam die ältere aramäische hebräische wohl der am weitesten verbreitete christliche weibliche Name ','Si emri i nënës së Jezusit, simbol i dashurisë së pastër dhe të thellë, kuptimi nuk është sqaruar me siguri; një mundësi: hidhërimi, një mundësi tjetër është origjina egjiptiane dhe prejardhja e mry (e dashura, në kuptimin nga: ai që është i dashur). , i cili është i dashur) Maria është forma e origjinës greke latine, Miriam e vjetër aramaike hebraisht është ndoshta emri femëror më i përhapur i krishterë '),
            array('Minea','1','Germany','Meaning not exactly known, perhaps from Latin mens (spirit, mind), but perhaps Etruscan; in Roman mythology, Minerva, a daughter of Jupiter and Juno, is the goddess of wisdom ','Bedeutung nicht genau bekannt, vielleicht von lateinisch mens (Geist, Verstand), vielleicht aber etruskisch; in der römischen Mythologie ist Minerva, eine Tocher von Jupiter und Juno, die Göttin der Weisheit','Kuptimi nuk dihet saktësisht, ndoshta nga latinishtja (shpirti, mendja), por ndoshta etruskisht; në mitologjinë romake, Minerva, një bijë e Jupiterit dhe Junos, është perëndeshë e mençurisë'),
