            array('Minona','1','Germany','Possibly invented, an Austrian actress real name was Johanna, but she called herself Minona; one of Beethovens (illegitimate) daughters also had this name. Minona read backwards is anonim (anonymous). Thats probably why Beethovens illegitimate daughter was called that.','Möglicherweise erfunden, eine österr. Schauspielerin hieß mit bürgerlichem Namen Johanna, nannte sich aber Minona; auch eine (uneheliche) Tochter Beethovens trug diesen Namen. Minona rückwärts gelesen ist anonim (anonym). Daher hieß wohl Beethovens uneheliche Tochter so. ','Ndoshta e shpikur, emri i vërtetë i një aktoreje austriake ishte Johanna, por ajo e quajti veten Minona; një nga vajzat (të paligjshme) të Beethoven kishte gjithashtu këtë emër. Minona e lexuar mbrapsht është anonim (anonim). Kjo është ndoshta arsyeja pse vajza jashtëmartesore e Beethoven u quajt kështu. '),
