            array('Monalie','1','Germany','New creation from Mona and Li(e) or invented female form of the Indian boys name Monali','Neuschöpfung aus Mona und Li(e) oder erfundene weibliche Form des indischen Jungennamen Monali','Krijim i ri nga Mona dhe Li(e) ose forma e shpikur femër e emrit të djalit indian Monali'),
            array('Moni','1','Germany','Origin not known with certainty is partly derived from Latin monachus monk was understood in the Middle Ages as belonging to Latin monere advice. Known through St. Monika (4th century), the mother of the church father Augustine, as St. Monika came from Carthage , the name could also be of North African or Phoenician origin ','Herkunft nicht sicher bekannt wird z.T. abgeleitet von lat. monachus Mönch wurde im Mittelalter verstanden als zu lat. monere beraten gehörig bekannt durch die hl. Monika (4. Jh.), der Mutter des Kirchenvaters Augustinus da die hl. Monika aus Karthago stammte, könnte der Name auch nordafrikanischer bzw. phönizischer Herkunft sein ','Origjina e panjohur me siguri rrjedh pjesërisht nga latinishtja monachus monk u kuptua në mesjetë si këshillë latine monere. Njihet përmes Shën Monikës (shek. IV), nëna e babait të kishës Agustinit, siç vinte Shën Monika. Carthage, emri mund të jetë gjithashtu me origjinë afrikano-veriore ose fenikase '),
            array('Monika','1','Germany','Origin not known with certainty; is partly derived from the Latin monachus = monk. In the Middle Ages it was understood as belonging to the Latin monere = to advise; known through St. Monika (4th century), the mother of the church father Augustine. Since the St. Monika came from Carthage, the name could also be of North African or Phoenician origin. Could also come from Greek and means the only one. Possibly Berbian (Moroccan) and literally means doll, which also sounds like a pet name for a girl.','Herkunft nicht sicher bekannt; wird z.T. abgeleitet von lat. monachus = Mönch. Wurde im Mittelalter verstanden als zu lat. monere = beraten gehörig; bekannt durch die hl. Monika (4. Jh.), der Mutter des Kirchenvaters Augustinus. Da die hl. Monika aus Karthago stammte, könnte der Name auch nordafrikanischer bzw. phönizischer Herkunft sein. Könnte auch aus dem Griechischen kommen und die Einzige heißen.Möglicherweise berbisch (marokkanisch) und heißt wortwörtlich Puppe, was ja auch nach einem Kosenamen für ein Mädchen klingt','Origjina nuk dihet me siguri; rrjedh pjesërisht nga latinishtja monachus = murg. Në mesjetë kuptohej se i përkiste latinishtes monere = të këshillosh; e njohur përmes Shën Monikës (shek. IV), nëna e babait të kishës. Augustini. Meqenëse Shën Monika erdhi nga Kartagjena, emri mund të jetë gjithashtu me origjinë afrikano-veriore ose fenikase. Mund të vijë gjithashtu nga greqishtja dhe do të thotë i vetmi. Ndoshta berbian (maroken) dhe fjalë për fjalë do të thotë kukull, që gjithashtu tingëllon si një kafshë shtëpiake emër për një vajzë.'),
            array('Montania','1','Germany','Mountain, the mountainous one','Berg, die Bergige','Mali, ai malor'),
