            array('Moriz','0','Germany','Originally a Roman nickname Mauricius the native of Mauritania, the Moor spread in the Middle Ages through the veneration of St. Mauritius, the leader of the Thebean Legion in Switzerland (4th century) ','Ursprünglich einrömischer Beiname Mauricius der aus Mauretanien Stammende, der Mohr im Mittelalter verbreitet durch die Verehrung des hl. Mauritius, des Anführer der Thebäischen Legion in der Schweiz (4. Jh.)','Fillimisht një pseudonim romak Mauricius me origjinë nga Mauritania, Maur u përhap në Mesjetë përmes nderimit të Shën Mauritius, udhëheqësit të Legjionit Thebean në Zvicër (shek. IV) '),
