            array('Natalina','1','Germany','Info about the male form Noel: from the Latin expression dies natalis (day of birth), which in Christianity is understood as Christs birthday. Meaning therefore the person born on Christs birthday (Christmas) noël is also the normal French word for Christmas ','Info zur männlichen Form Noel: vom lateinischen Ausdruck dies natalis (Tag der Geburt), welcher im Christentum als der Geburtstag Christi verstanden wird Bedeutung deshalb der am Geburtstag Christi (Weihnachten) Geborene noël ist zugleich das normale französische Wort für Weihnachten','Informacion për formën mashkullore Noel: nga shprehja latine dies natalis (dita e lindjes), e cila në krishterim kuptohet si ditëlindja e Krishtit. Pra do të thotë personi i lindur në ditëlindjen e Krishtit (Krishtlindjet) noël është gjithashtu fjala normale franceze për Krishtlindjet'),
