            array('Renita','1','Germany','Renita is usually seen as a variant of Renate, but can also be derived from Spanish as an independent name (diminutive of rey = the little queen); translations such as the willing one can also be found in South America','Renita wird meist als Variante von Renate gesehen, kann jedoch auch als eigenständiger Name aus dem Spanischen hergeleitet werden (Verkleinerung von rey = die kleine Königin); auch Übersetzungen wie die Bereitwillige finden sich im südamerikanischen Bereich','Renita zakonisht shihet si një variant i Renate, por gjithashtu mund të rrjedh nga spanjishtja si një emër i pavarur (zvogëlimi i rey = mbretëresha e vogël); përkthime të tilla si ai i gatshëm mund të gjenden gjithashtu në Amerikën e Jugut.'),
