            array('Resi','1','Germany','Origin not exactly known, perhaps to ther (huntable animal) and therefore with meaning hunter Therasia is the name of a small island next to Thera or Santorini, the name is therefore often interpreted as a woman from the island of Therasia ','Herkunft nicht genau bekannt, vielleicht zu ther (jagdbares Tier) und somit mit Bedeutung Jägerin Therasia ist der Name einer kleinen Insel neben Thera bzw. Santorin der Name wird darum oft gedeutet als Frau von der Insel Therasia','Origjina nuk dihet saktësisht, ndoshta për atë (kafshë e gjuetueshme) dhe për këtë arsye me kuptimin gjuetar Therasia është emri i një ishulli të vogël pranë Therës ose Santorinit, prandaj emri shpesh interpretohet si një grua nga ishulli Therasia'),
            array('Reta','1','Germany','There are two possible derivations: adopted into German as a name from Latin; spread in the Middle Ages by the name of St. Margaret of Antioch; the Greek word margarites perhaps originally comes from Persian with the meaning child of light (according to the idea of the Pearl as a drop of dew, which was changed by moonlight); as a male form of Reto: the Romansh (from the Romansh area in the Swiss Alps) goes back to Rhaetia or Raetia, the name of a Roman province (roughly in the area of todays Graubünden, Tyrol and Voralberg); the name of the province is perhaps of Celtic origin, from rait (mountainland)','Es gibt zwei mögliche Herleitungen: als Name aus dem Lateinischen ins Deutsche übernommen; im Mittelalter verbreitet durch den Namen der hl. Margarete von Antiochia; das griechische Wort margarites stammt vielleicht ursprünglich aus dem Persischen mit der Bedeutung Kind des Lichts (gemäß der Vorstellung der Perle als Tautropfe, der durch Mondlicht verändert wurde);als männliche Form von Reto: der Rätoromane (aus dem Gebiet der Rätoromanen in den Schweizer Alpen) geht zurück auf Rhaetia oder Raetia, dem Namen einer römischen Provinz (etwa im Gebiet des heutigen Graubünden, Tirol und Voralberg); der Name der Provinz ist vielleicht keltischen Ursprungs, von rait (Bergland)','Ka dy prejardhje të mundshme: i adoptuar në gjermanisht si emër nga latinishtja; u përhap në mesjetë me emrin e Shën Margaretës së Antiokisë; fjala greke margarites ndoshta vjen fillimisht nga persishtja me kuptimin fëmijë i dritës (sipas ideja e Perlës si një pikë vese, e cila u ndryshua nga drita e hënës); si një formë mashkullore e Reto: Romansh (nga zona romake në Alpet zvicerane) shkon prapa në Rhaetia ose Raetia, emri i një romak. krahinë (përafërsisht në zonën e Graubünden, Tirolit dhe Voralberg-ut të sotëm); emri i krahinës është ndoshta me origjinë kelte, nga rait (malor)'),
            array('Reto','0','Germany','Male first name, which is mainly used in SwitzerlandThe Romansh (from the Romansh area in the Swiss Alps) goes back to the name Rhaetia or Raetia, a former Roman province (roughly in the area of todays Graubünden, Tyrol and Voralberg)','Männlicher Vorname, der vor allem in der Schweiz gebräuchlich istDer Rätoromane (aus dem Gebiet der Rätoromanen in den Schweizer Alpen) geht zurück auf die Namen Rhaetia oder Raetia, eine ehemalige römische Provinz (etwa im Gebiet des heutigen Graubünden, Tirol und Voralberg)','Emri i parë mashkullor, i cili përdoret kryesisht në Zvicër. Romansh (nga zona romake në Alpet zvicerane) shkon prapa në emrin Rhaetia ose Raetia, një provincë e dikurshme romake (afërsisht në zonën e Graubünden, Tirolit dhe Voralberg-ut të sotëm) '),
