            array('Sidonius','0','Germany','Known by St. Sidonius Apollinaris (5th century) Sidon (today Saida in Lebanon) was an important Phoenician trading city in ancient times - the name of the city perhaps goes back to a Semitic root meaning hunting or fishing','Bekannt durch den hl. Sidonius Apollinaris (5. Jh.) Sidon (heute Saida im Libanon) war im Altertum eine wichtige phönizische Handelsstadt der Name der Stadt geht vielleicht auf eine semitische Wurzel mit der Bedeutung jagen oder fischen zurück','I njohur nga Shën Sidonius Apollinaris (shek. V) Sidoni (sot Saida në Liban) ishte një qytet i rëndësishëm tregtar fenikas në kohët e lashta - emri i qytetit ndoshta shkon prapa në një rrënjë semite që do të thotë gjueti ose peshkim.'),
