            array('Sieglinde','1','Germany','Female first name with Germanic origin; composed of the Germanic name elements sigi (=victory) and linde (=gentle, soft, mild). The name is known from the Nibelungen saga. There Sieglinde is Siegfrieds mother.','Weiblicher Vorname mit germanischer Herkunft; zusammengesetzt aus den germanischen Namenselementen sigi (=Sieg) und linde (=sanft, weich, mild).Der Name ist bekannt aus der Nibelungensage. Dort ist Sieglinde die Mutter Siegfrieds.','Emri i parë femër me origjinë gjermanike; i përbërë nga elementet e emrit gjermanik sigi (=fitore) dhe linde (=i butë, i butë, i butë). Emri njihet nga saga Nibelungen. Atje Sieglinde është nëna e Siegfried.'),
            array('Sieglinde Carla','1','Germany','Sieglinde: female first name with Germanic origin; in the Nibelungen saga, Sieglinde is the mother of Siegfried Carla: variant of Karla, the female form of Karl','Sieglinde: weiblicher Vorname mit germanischer Herkunft; in der Nibelungensage ist Sieglinde die Mutter SiegfriedsCarla: Variante von Karla, der weiblichen Form von Karl','Sieglinde: emri i parë femër me origjinë gjermanike; në sagën Nibelungen, Sieglinde është nëna e Siegfried Carla: variant i Karla, forma femërore e Karlit'),
            array('Sieglinde Ingrid','1','Germany','Sieglinde: female first name with Germanic origin; in the Nibelungen saga, Sieglinde is Siegfrieds mother Ingrid: old Nordic two-part name; the first name element Ing goes back to Ing Ingwio, the name of a Germanic deity; the name was created at the end of the 19th century. adopted from Scandinavian into German ','Sieglinde: weiblicher Vorname mit germanischer Herkunft; in der Nibelungensage ist Sieglinde die Mutter SiegfriedsIngrid: alter nordischer zweigliedrieger Name; das erste Namenselement Ing geht zurück auf Ing Ingwio, dem Namen einer germanischen Gottheit; der Name wurde Ende des 19. Jh. aus dem Skandinavischen ins Deutsche übernommen','Sieglinde: emri i parë femër me origjinë gjermanike; në sagën Nibelungen, Sieglinde është nëna e Siegfried Ingrid: emër i vjetër nordik me dy pjesë; elementi i parë i emrit Ing shkon prapa në Ing Ingwio, emri i një hyjnie gjermane; emri ishte krijuar në fund të shekullit të 19-të. adoptuar nga skandinave në gjermanisht'),
            array('Sieglinde Olga','1','Germany','Sieglinde: female first name with Germanic origin; in the Nibelungen saga, Sieglinde is Siegfrieds mother Olga: Russian form of Helga','Sieglinde: weiblicher Vorname mit germanischer Herkunft; in der Nibelungensage ist Sieglinde die Mutter SiegfriedsOlga: russische Form von Helga','Sieglinde: emri i parë femër me origjinë gjermanike; në sagën Nibelungen, Sieglinde është nëna e Siegfried Olga: forma ruse e Helga'),
            array('Sieglinde Susanna','1','Germany','Sieglinde: female first name with Germanic origin; in the Nibelungen saga, Sieglinde is Siegfrieds mother Susanna: derivation of the Greek form Sousanna of the Hebrew name Schoschanna or Shoshana, meaning lily; the underlying Hebrew word has Egyptian roots; in the Apocrypha there are a story of Susanne in the bath, who is wrongly accused ','Sieglinde:weiblicher Vorname mit germanischer Herkunft; in der Nibelungensage ist Sieglinde die Mutter SiegfriedsSusanna: Ableitung der griechischen Form Sousanna des hebräischen Namens Schoschanna bzw. Shoshana, mit der Bedeutung Lilie; das zugrundeliegende hebräische Wort hat ägyptische Wurzeln; in den Apokryphen gibt es eine Geschichte von Susanne im Bade, die zu Unrecht angeklagt wird','Sieglinde: emri i parë femëror me origjinë gjermanike; në sagën Nibelungen, Sieglinde është nëna e Siegfried-it Susanna: prejardhje e formës greke Sousanna e emrit hebraik Schoschanna ose Shoshana, që do të thotë zambak; fjala e poshtme hebraike ka rrënjë egjiptiane; në Apokrife atje janë një histori e Suzanës në banjë, e cila akuzohet gabimisht'),
            array('Sieglinde Ute','1','Germany','Sieglinde: female first name with Germanic origin; in the Nibelungen saga Sieglinde is the mother of Siegfried Ute: known from the Nibelungenlied as the mother of Kriemhild ','Sieglinde: weiblicher Vorname mit germanischer Herkunft; in der Nibelungensage ist Sieglinde die Mutter SiegfriedsUte: bekannt aus dem Nibelungenlied als Mutter Kriemhilds ','Sieglinde: emri i parë femër me origjinë gjermanike; në sagën Nibelungen Sieglinde është nëna e Siegfried Ute: e njohur nga Nibelungenlied si nëna e Kriemhild '),
