            array('Sietse','0','Germany','Sietse is a Frisian male first name. The exact meaning is unclear, but it is believed that the word was originally derived from Germanic and means victory.','Sietse ist ein friesischer männlicher Vorname. Die genaue Bedeutung ist ungeklärt, aber man vermutet, dass das Wort ursprünglich aus dem Germanischen abgeleitet wurde und Sieg bedeutet.','Sietse është një emër i parë mashkullor frizian. Kuptimi i saktë është i paqartë, por besohet se fjala ka rrjedhur fillimisht nga gjermanishtja dhe do të thotë fitore.'),
