            array('Siglinde','1','Germany','Sieglinde is a variant of Sieglinde. The name Sieglinde is composed of the Germanic name elements sigi (=victory) and linde (=gentle, soft, mild). In the Niebelungen saga, Sieglinde is the mother of Siegfried.','Sieglinde ist eine Variante von Sieglinde. Der Name Sieglinde ist aus den germanischen Namenselementen sigi (=Sieg) und linde (=sanft, weich, mild) zusammengesetzt. In der Niebelungensage ist Sieglinde die Mutter Siegfrieds.','Sieglinde është një variant i Sieglinde. Emri Sieglinde është i përbërë nga elementet e emrit gjermanik sigi (=fitore) dhe linde (=i butë, i butë, i butë). Në sagën Niebelungen, Sieglinde është nëna e Siegfried.'),
