            array('Siguna','1','Germany','Known by the character in Parzival by Wolfram von Eschenbach (13th century), the name perhaps contains the element sigu (victory) and there is a connection with the Old Norse name Sigyn','Bekannt durch die Figur in Parzival von Wolfram von Eschenbach (13. Jh.) der Name enthält vielleich das Element sigu (Sieg) und es besteht ein Zusammenhang mit dem altnordischen Namen Sigyn','I njohur nga personazhi në Parzival nga Wolfram von Eschenbach (shek. 13), emri ndoshta përmban elementin sigu (fitore) dhe ka një lidhje me emrin e vjetër norvegjez Sigyn.'),
            array('Sigune','1','Germany','Known by the character in Parzival by Wolfram von Eschenbach (13th century), the name perhaps contains the element sigu (victory) and there is a connection with the Old Norse name Sigyn','Bekannt durch die Figur in Parzival von Wolfram von Eschenbach (13. Jh.) der Name enthält vielleich das Element sigu (Sieg) und es besteht ein Zusammenhang mit dem altnordischen Namen Sigyn','I njohur nga personazhi në Parzival nga Wolfram von Eschenbach (shek. 13), emri ndoshta përmban elementin sigu (fitore) dhe ka një lidhje me emrin e vjetër norvegjez Sigyn.'),
