            array('Silea','1','Germany','Name of a town near Venice as a first name; not common as a first name in Italy; also the name of a Romanian village; not to be confused with Sileas, the Scottish Gaelic form of Julia','Name einer Stadt nahe Venedig als Vorname; in Italien nicht als Vorname üblich; auch der Name eines rumänischen Dorfes; nicht zu verwechseln mit Sileas, der schottisch-gälischen Form von Julia','Emri i një qyteti afër Venecias si emër i parë; jo i zakonshëm si emër i parë në Itali; gjithashtu emri i një fshati rumun; të mos ngatërrohet me Sileas, forma gaelie skoceze e Julia'),
            array('Silena','1','Germany','Possibly the feminine form of Silenos; in Greek mythology, Silenos is a companion of Dionysus, the god of wine; the name perhaps comes from a word meaning flowing','Evtl. die weibliche Form von Silenos; in der griechischen Mythologie ist Silenos ein Begleiter von Dionysos, dem Gott des Weines; der Name stammt vielleicht von einem Wort mit der Bedeutung fließend','Ndoshta forma femërore e Silenos; në mitologjinë greke, Silenos është një shoqërues i Dionisit, perëndisë së verës; emri ndoshta vjen nga një fjalë që do të thotë rrjedh'),
            array('Silia','1','Germany','Variant of Silja, the Scandinavian form of Cäcilie','Variante von Silja, der skandinav. Form von Cäcilie','Varianti i Silja, forma skandinave e Cäcilie'),
