            array('Silias','0','Germany','Male form of Silia, a variant of Silja (Scandinavian form of Cäcilie)','Männliche Form von Silia, einer Variante von Silja (skandinav. Form von Cäcilie)','Forma mashkullore e Silia, një variant i Silja (forma skandinave e Cäcilie)'),
            array('Silina','1','Germany','New creation from names like Selina and Silena; in Greek mythology, Selene is the moon goddess Silena: possibly the female form of Silenos; in Greek mythology, Silenos is a companion of Dionysus, the god of wine; the name perhaps comes from a word with the meaning flowing ','Neuschöpfung aus Namen wie Selina und Silena;in der griechischen Mythologie ist Selene die Mondgöttin Silena: evtl. die weibliche Form von Silenos; in der griechischen Mythologie ist Silenos ein Begleiter von Dionysos, dem Gott des Weines; der Name stammt vielleicht von einem Wort mit der Bedeutung fließend','Krijim i ri nga emra si Selina dhe Silena; në mitologjinë greke, Selena është perëndeshë e hënës Silena: ndoshta forma femërore e Silenos; në mitologjinë greke, Silenos është një shoqërues i Dionisit, perëndisë së verës; emri ndoshta vjen nga një fjalë me kuptimin që rrjedh '),
            array('Silja','1','Germany','Low German, Frisian, Swedish, Finnish short or pet form of Cäcilie Cäcilia. Loosely translated, the name means: the divine or the concentrated knowledge. Cäcilie is the female form of the ancient Roman family name Caecilius, perhaps of Etruscan origin. Folk etymologically interpreted as to caecus (=blind); known through the veneration of St. Cecilia (3rd century).','Niederdeutsche, friesische, schwedische, finnische Kurz- bzw. Koseform von Cäcilie Cäcilia. Frei übersetzt bedeutet der Name: die Göttliche bzw. das geballte Wissen. Cäcilie ist die weibliche Form des altrömischen Familiennamens Caecilius, vielleicht etruskischen Ursprungs. Volksetymologisch gedeutet als zu caecus (=blind) gehörig; bekannt durch die Verehrung der hl. Cäcilie (3. Jh.).','Gjermanisht e ulët, friziane, suedeze, finlandeze, formë e shkurtër ose e përkëdhelur e Cäcilie Cäcilia. Përkthyer lirshëm, emri do të thotë: dija hyjnore ose e përqendruar. Cäcilie është forma femërore e emrit të familjes romake të lashtë Caecilius, ndoshta me origjinë etruske. Folk interpretohet etimologjikisht si caecus (= i verbër); i njohur përmes nderimit të Shën Cecilisë (shek. III).'),
            array('Silka','1','Germany','Female form of the ancient Roman family name Caecilius; perhaps of Etruscan origin; folk etymologically interpreted as belonging to caecus blind; known through the veneration of St. Cecilia (3rd century) ','Weibliche Form des altrömischen Familiennamens Caecilius; vielleicht etruskischen Ursprungs; volksetymologisch gedeutet als zu caecus blind gehörig; bekannt durch die Verehrung der hl. Cäcilie (3. Jh.)','Forma femërore e emrit të familjes romake të lashtë Caecilius; ndoshta me origjinë etruske; popullore e interpretuar etimologjikisht se i përket caecus blind; e njohur nga nderimi i Shën Cecilias (shek. III) '),
            array('Silke','1','Germany','Female first name, several derivations are possible: Silke can be a Low German-Frisian pet form of Cäcilie (from Latin caecus). In addition, Seilke can be a German pet form of Celia. Furthermore, Silke can be a short form of Gisela.','Weiblicher Vorname, mehrere Herleitungen sind möglich: So kann Silke eine niederdeutsch-friesische Koseform von Cäcilie sein (von lat. caecus). Außerdem kann Seilke ein deutsche Koseform von Celia sein. Darüber hinaus kann Silke eine Kurzform von Gisela sein.','Emri i parë femëror, disa prejardhje janë të mundshme: Silke mund të jetë një formë e përkëdhelur gjermano-friziane e Cäcilie (nga latinishtja caecus). Përveç kësaj, Seilke mund të jetë një formë shtëpiake gjermane e Celia. Për më tepër, Silke mund të jetë një formë e shkurtër e Xhisiela'),
            array('Silmeria','1','Germany','Silmeria is the (invented) name of a computer game character','Silmeria ist der (erfundene) Name einer Computerspielfigur','Silmeria është emri (i shpikur) i një personazhi të lojës kompjuterike'),
            array('Silpa','1','Germany','Name of a figure from the Bible who, along with three other women, is considered the mother of the tribes of Israel; meaning unknown','Name einer Figur aus der Bibel, die neben drei anderen Frauen als Stammmutter der Stämme Israels gilt; Bedeutung unbekannt','Emri i një figure nga Bibla, e cila, së bashku me tre gra të tjera, konsiderohet nëna e fiseve të Izraelit, që do të thotë e panjohur'),
