            array('Silvester','0','Germany','Spread by St. Silvester, Pope in the 3rd 4th century; so far 3 popes have had the name Silvester','Verbreitet durch den hl. Silvester, Papst im 3. 4. Jh.; bisher trugen 3 Päpste den Namen Silvester','Përhapur nga Shën Silvester, Papa në shekullin III IV; deri tani 3 papë kanë pasur emrin Silvester'),
