            array('Tatjara','1','Germany','Probably an invented form of Tatjana; from the feminine form of the Roman first name Tatianus, which is derived from the family name Tatius; Tatius was the name of a king of the Sabines who ruled the Romans together with Romulus; the origin and meaning of the family name Tatius are not known','Wahrscheinlich eine erfundene Form von Tatjana; von der weiblichen Form des römischen Vornamens Tatianus, der vom Familiennamen Tatius abgeleitet ist; Tatius hieß ein König der Sabiner, der mit Romulus zusammen die Römer regierte; Herkunft und Bedeutung des Familiennamens Tatius sind nicht bekannt','Ndoshta një formë e shpikur e Tatjana; nga forma femërore e emrit të parë romak Tatianus, i cili rrjedh nga emri i familjes Tatius; Tatius ishte emri i një mbreti të Sabinëve që sundoi romakët së bashku me Romulusin; origjina dhe kuptimi mbiemri Tatius nuk dihet.'),
            array('Tatje','2','Germany','Tat is said to have a Frisian origin and means father, the comparison of Tat with the English Dad is obvious. Tatje was the nickname for a fathers children when they had children of their own. Such nicknames often later became family names, such as at Janssen, which is said to have meant son of Jan. On the other hand, Tatje can also be found as a girls name in Frisian.','Tat soll einen friesischen Ursprung haben und Vater bedeuten, der Vergleich von Tat mit den englischen Dad liegt nahe. Tatje wurden die Kinder eines Vaters dann mit Spitznamen genannt, wenn sie selber wieder Kinder hatten. Häufig wurden solche Spitznamen später zu Familiennamen, wie z.B. bei Janssen, was Sohn des Jan bedeutet haben soll. Andererseits ist Tatje auch als Mädchenname im Friesieschen zu finden.','Tat thuhet se ka origjinë friziane dhe do të thotë baba, krahasimi i Tat me anglezin Dad është i dukshëm. Tatje ishte pseudonimi për fëmijët e babait kur ata kishin fëmijë të tyre. Pseudonime të tilla shpesh më vonë u bënë emra familjarë, si p.sh. në Janssen, që thuhet se do të thoshte djali i Janit. Nga ana tjetër, Tatje mund të gjendet edhe si emër vajze në frizianisht.'),
