            array('Terese','1','Germany','The first name Terese is a variant of Therese. The name comes from ancient Greek, but the origin cannot be determined exactly. Four approaches are conceivable: 1. from the Greek city of Thera or the island of Santorini, the meaning would be in this Case that comes from Thera or be a resident of Thera 2. from Greek therizo meaning harvest worker 3. to Greek theros (= summer) 4. to Greek ther (= huntable animal) and thus meaning hunter','Der Vorname Terese ist eine Variante von Therese. Der Name stammt aus dem Altgriechischen, die Herkunft lässt sich aber nich ganz genau bestimmen. Vier Ansätze sind denkbar: 1. von der griechischen Stadt Thera bzw. der Insel Santorin, die Bedeutung würde in diesem Fall die von Thera kommt oder Bewohnerin von Thera sein 2. aus griechisch therizo mit der Bedeutung Erntearbeiterin 3. zu griechisch theros (=Sommer) 4.zu griechisch ther (=jagdbares Tier) und somit mit Bedeutung Jägerin','Emri i parë Terese është një variant i Therese. Emri vjen nga greqishtja e vjetër, por origjina nuk mund të përcaktohet saktësisht. Katër qasje janë të imagjinueshme: 1. nga qyteti grek i Therës ose ishulli i Santorinit, kuptimi do të ishte në ky rast që vjen nga Thera ose të jetë banor i Therës 2. nga greqishtja therizo që do të thotë punëtor korrjesh 3. në greqisht theros (= verë) 4. në greqisht ther (= kafshë e gjuetshme) dhe kështu do të thotë gjahtar'),
            array('Teresia','1','Germany','Origin not exactly known, perhaps to ther (huntable animal) and therefore with meaning hunter Therasia is the name of a small island next to Thera or Santorini, the name is therefore often interpreted as a woman from the island of Therasia ','Herkunft nicht genau bekannt, vielleicht zu ther (jagdbares Tier) und somit mit Bedeutung Jägerin Therasia ist der Name einer kleinen Insel neben Thera bzw. Santorin der Name wird darum oft gedeutet als Frau von der Insel Therasia','Origjina nuk dihet saktësisht, ndoshta për atë (kafshë e gjuetueshme) dhe për këtë arsye me kuptimin gjuetar Therasia është emri i një ishulli të vogël pranë Therës ose Santorinit, prandaj emri shpesh interpretohet si një grua nga ishulli Therasia'),
